INSERT INTO `comments` VALUES ('249', '4', '1763', '184', '184', 'Los Navegantes del Magallanes fueron establecidos por primera vez en 1917 como el equipo Magallanes de Catia, entre sus fundadores aparecen resaltados Juan y Luis Carrat, la familia Fagre y los turcos Alberto y Ricardo Salomn, Vicente Issa y Eduardo Kalil. Luego, la Liga Nacional de Bisbol se establece en el ao de 1927, por ese motivo el equipo fue puesto en pie ya que se decidi organizar anualmente campeonatos de liga. Magallanes estaba listo para ingresar a su categora.<br><br>    El deporte se fue incrementando en el pas para dar origen a muchos equipos, entre los ms resaltantes aparecen Cervecera Caracas, Pastora, Gavilanes y el Royal Criollos. La mejor poca del bisbol en Venezuela estuvo comprendido entre los aos 44 y 50, cuando la pasin estall por parte del pblico dando a conocer como los equipos ms populares a Gavilanes, Magallanes y Cervecera Caracas.<br><br>    En este periodo el equipo Magallanes particip en ocho certmenes de primera divisin  logr capturar dos ttulos y dos subcampeonatos. Don Carlos Lavaud en 1941 compra al equipo y le da una nueva perspectiva, se comenzaban a realizar los navegantes de hoy en da, as, al crearse la Liga Profesional de Bisbol, Magallanes fue uno de cuatro equipos en participar en el primer torneo de 1946.<br><br><br>    El equipo dej de llamarse Magallanes para convertirse en la temporada del 1956 en Oriente y respectivamente luego en Orientales. Fue un nuevo paso para el equipo, un respiro momentneo para volver en el torneo 1964-1965.<br><br><br>    Mucho nos da de que hablar el equipo turco &quot;cariosamente llamado&quot;. Magallanes se vino a ms para conquistar seis gallardetes, los ms sobresalientes en los aos noventa contra su rival Caracas, estos se han enfrentado en dos nicas finales y Magallanes ha salido ganador. La ltima victoria fue en la temporada 96-97. Tiene 9 campeonatos y dos Series del Caribe en las ediciones de 1970 y 1979.<br><br> <br><br>1946:<br><br>En la primera Temporada de Bisbol Profesional Venezolano, Magallanes gana el primer juego celebrado en la Liga, venciendo al Venezuela el 12 de enero con score de 5 a 2. El equipo se apunta la primera carrera anotada en la pelota rentada por Luis Aparicio Ortega, el primer boleto recibido en el beisbol profesional, por Vidal Lpez, y el primer lanzador en obtener un triunfo, Alejandro Carrasquel. Ms adelante, Quincy Troupe dispara el primer cuadrangular del club y Vidal Lpez el primero como bateador emergente. Al final de la campaa algunos magallaneros atrapan lideratos individuales, como &quot;Chucho Ramos&quot;, lder en hits con 49 y en anotadas con 30. Mientras, Pablo Garca se coron monarca entre los bateadores con promedio de .403 puntos luego de 31 imparables en 77 visitas al plato.<br><br>1946-47:<br><br>Magallanes trae el primer importado con experiencia de Liga Mayor en la persona del lanzador Sam Nahem. El 12 de Abril Nahem lanza completo por dcima tercera oportunidad de manera consecutiva, estableciendo un record para nuestra liga que todava permanece vigente. Vidal Lpez termina como lder entre los jonroneros al sacar 6 pelotas del parque, y Nahem lidera los renglones de ms triunfos con 12, y ms bateadores abanicados con 114.<br><br>1947-48:<br><br>El club queda tercero a nueve juegos del ganador, pero Vidal Lpez, el primer dolo de Bisbol venezolano, logra capturar el ttulo de los bateadores con promedio de .374. Tambin empuja 32, da 11 dobles y 4 vuelacercas para ser seleccionado por el Crculo de Periodistas Deportivos como Pelotero del Ao.<br><br>1948-49:<br><br>Luego de liderar la tabla de posiciones durante la mayor parte del campeonato, Magallanes perdi sus dos ltimos desafos frente a Cervecera Caracas, equipo que le arrebat el ttulo dejndolo en segundo lugar. Jim Pendelton con 8 jonrones 25 impulsadas resulta el ms destacado del elenco turco.<br><br>1949-50:<br><br>Magallanes captura su primer gallardete, capitaneado por Lzaro Salazar &quot;El Prncipe de Beln&quot;, siendo el club que propin ms blanqueos en la campaa con 6. Theolic Smith comparte el liderato de juegos ganados con 8, Jim Pendelton es campen bate con .387 y mayor anotador con 47, mientras que Vidal Lpez es el mximo jonronero y remolcador con 9 y 43. El 17 de noviembre Luis &quot;Camalen &quot; Garca inicia una histrica seguidilla de juegos en nuestra Liga y es designado &quot;Novato del Ao&quot; al finalizar la contienda.<br><br>1950-51:<br><br>Magallanes repite el ttulo, apuntalando por los bates de Camalen Garca, Vidal Lpez, Jim Pendelton, Joe Monteiro y Johnny Davis y por el brazo de Clem Labine, quin gan 13 estableciendo una marca de ms triunfos contra un equipo en una misma temporada, al vencer al Cervecera Caracas.<br><br>1951-52:<br><br>El 14 de Febrero de 1952 en juego contra Cervecera Caracas, Camalen establece un record de turnos en un encuentro, al pararse en el Home en 9 oportunidades. Por su parte Johnny Hetki permaneci sobre el montculo durante los 18 episodios del mismo partido para fijar un record an vigente en el profesional. Al final los turcos quedan con 28 y 28 en segundo lugar.<br><br>1952-53:<br><br>Durante el primer partido de esa campaa entre Magallanes y los debutantes Leones del Caracas, el Pitcher turco Johnny Mackinson mantuvo sin hits a los felinos durante 10 innings y 2 tercios, hasta que Alfonso Carrasquel solt el primer indiscutible. Eso ocurri el 19 de Octubre, y despus de 13 entradas el match se decidi cuando Magallanes fabric 9 anotaciones para imponerse 10 a 1. Luis &quot;Camalen&quot; Garca alcanza los lideratos de jonrones (8) y empujadas (47). El 8 de enero Quincy Troupe estableci una marca al recibir 6 boletos en un solo partido. Esto fue ante el Caracas.<br><br>1953-54:<br><br>El 14 de octubre, Bill Taylor y George Wilson sacan cada uno dos para la calle, mientras Foster Castleman y Bill Gardner conectan uno por lado para ganar 8 a 2 al que se convertira en monarca de ese ao, el Pastora, en el llamado campeonato rotatorio, estableciendo un record para la Liga de seis cuadragunlares en un juego por un mismo equipo. Al final Magallanes llega segundo, pero Bill Taylor captura el ttulo de jonrones con 16 (incluyendo un juego con tres vuelacercas frente al Caracas el 24-01-54) y de remolcador con 63 implantando nuevos registros en ambos departamentos, mientras impuso las marcas an vigentes de ms bases alcanzadas en una Temporada con 162 y de ms turnos en una campaa con 308, cantidad que tambin consumi Castleman. Por su parte Camalen Garca logra su mejor palmars en nuestro Bisbol al alcanzar sus topes en juegos (78), turnos (307), carreras (54), hits (93), dobles (17), jonrones (11) y empujadas (50). Ramn Monzant resulta lder en ganados con 14 y en ponches con 132, a la vez que George Spencer implanta un record de juegos lanzados con 44. El club consume 2 mil 687 turnos oficiales en la temporada, un record para la Liga.  <br><br>1954-55:<br><br>Por tercer ao consecutivo un magallanero lidera la Liga en cuadrangulares y en remolcadas. Esta Vez Bob Lennon fue el mejor jonronero al sacar 9 mientras remolcaba 37. Por su parte Camalen Garca anota 32 para encabezar ese rengln, y Ramn Monzant es el mximo ganador y ponchador del circuito por segundo ao, con 11 triunfos y 96 abanicados, y segundo en efectividad con 2.00, superado slo por el Carrao Bracho (1.80). Magallanes obtiene su tercer gallardete protagonizando una increble recuperacin y se acredita el segundo ttulo de un equipo venezolano ante un campen cubano en Series del Caribe. Esto fue el 14 de Febrero de 1955 contra Alacranes de Almendares.<br><br>1955-56:<br><br>Esta fue la primera campaa del Magallanes sin Vidal Lpez, ya que un ao antes haba anunciado su retiro. El 8 de diciembre Magallanes recibe el primer no hit no run de nuestro Bisbol profesional. El victimario fue el lanzador Len Yochim de los Leones del Caracas. Ese ao los marinos naufragan en el mes de enero, a pesar de que Norman Larker obtuvo el ttulo de bateo (.340), Gale Wade los de hits (75), carreras anotadas (44) y bases robadas (11), y Ramn Monzant logr por tercer ao seguido los ttulos de ms ganador y mximo ponchador (10 y 119). Al terminar la temporada, ocurri una grave crisis econmica que sac al Magallanes de los torneos locales durante ocho campaas.<br><br>1964-65:<br><br>Antonio Jos Istriz se convierte en el nuevo dueo del club, Magallanes reaparece en el Bisbol para beneplcito de su amplia legin de fanticos. El 27 de noviembre de 1964 Luis &quot;Camalen&quot; Garca conecta tres imparables, los nmeros 900, 901 y 902 de su carrera. El 22 de enero Alfonso Carrasquel juega su ltimo partido como campocorto en Venezuela, con el uniforme del Magallanes. Al final el conjunto queda eliminado, aunque Camalen atrapa el liderato de bateadores al promediar .394 puntos.<br><br>1965-66:<br><br>El 15 de octubre, fecha inaugural del torneo, el novato Graciliano Parra mantuvo sin hits ni carreras por espacio de 9 innings y 2 tercios a Tiburones de la Guaira (campen de la 64-65 y a la postre tambin monarca de esta temporada), y apenas en el dcimo episodio el cubano Jos Martnez le conecta sencillo al centro. Al final Magallanes gana 1 a 0. El conjunto clasifica amparado en el bate de Tommy Agee, quin lider al club en casi todos los renglones ofensivos, pero al llegar el play-off cae ante Tiburones en el mximo de cinco juegos, pese a ganar los dos primeros desafos y ponerse a punto del pase a la final.<br><br>1966-67:<br><br>El 25 de octubre a la altura del quinto episodio, &quot;Camalen&quot; toma un turno frente al pitcher de Cardenales Ken Sanders y dispara un incogible, para convertirse en el primero que golpea mil hits en la pelota venezolana, justo cuando participaba en su dcima octava temporada profesional. De esta forma, el pelotero de Carpano daba otro paso hacia la inmortalidad. A pesar de quedar eliminados en un mini play-off de desempate por el tercer y cuarto lugar contra la Guaira y Valencia, destaca la labor desplegada por Gracialino Parra, quin deja balance de 7 y 3 con efectividad de 2.11; y el record establecido por Bill Connors al aparecer como relevista en 40 cotejos, en lo que tuvo 4 y 4 con 10 rescates y efectividad de 2.01.<br><br>1967-68:<br><br>El 30 de diciembre, frente a Cardenales de Lara, Isaas &quot;Ltigo&quot; Chvez obtiene su quinta victoria de la campaa, la ltima que lograra con la camiseta marina. El 13 de enero fue su ltima aparicin con el Magallanes antes de su muerte. El club concluye ltimo con balance de 21 y 39.<br><br>1968-69:<br><br>Son adquiridos Dmaso Blanco y Gustavo Gil, mientras que Pat Kelly y Clarence Gaston inician la tradicn del &quot;Poder Negro&quot;. El 24 de octubre el melenudo Howie Reed le propina no hit no run al Magallanes. Gaston establece un nuevo record de empujadas con 64, y tambin comanda la Liga en dobletes con 14 y bateo con .383, para convertirse en el &quot;Jugador Ms Valioso&quot;. Esta fue la ltima campaa de Camalen Garca con el Magallanes. El 16 de marzo de 1969, Isaa &quot;Ltigo&quot; Chvez, de 21 aos, fallece cuando el avin que lo llevaba al campo de entrenamiento de los Gigantes en Arizona se desploma justo al salir de Aeropuerto &quot;Grano de Oro&quot; en Maracaibo, acabando tambin con la vida de Carlos Santelz, pelotero del Cardenales de Lara, y del propietario de ese equipo, Don Antonio Herrera.<br><br>1969-70:<br><br>Magallanes es vendido a un grupo de personas de Carabobo y se muda para Valencia. Bajo la conduccin de Patato Pascual conquista su primer ttulo desde la campaa 1954-55, derrotando en esta ocasin a los Tiburones de la Guaira en solo tres juegos. A pesar de partir antes de finalizar la temporada, Gaston repite el ttulo de bateo con .360. Ese ao se vuelve a jugar la Serie del Caribe, y el escenario es el Estadio Universitario. Magallanes se apoya en el pitcheo y obtiene el primer ttulo del Caribe para un equipo venezolano, venciendo a los representantes de Repblica Dominicana y Puerto Rico.<br><br>1970-71:<br><br>El 27 de octubre se empata un record de la Liga (tro de jonrones en un inning) cuando Gustavo Gil conecta cuadrangular por el jardn izquierdo, Jim Holt por el centro y Harold King por el derecho durante el sexto inning de un partido jugado contra los Leones, lo que adems se convierte en toda una curiosidad por la reparticin del poder. El 14 de diciembre Herman Hill, outfielder importado, muere ahogado en la playa Guaicamacuto de Puerto Cabello, Magallanes logra una difcil clasificacin, apoyado en el bate de Jim Holt, quin remolca 38 anotaciones. Pese a no ser considerado como favorito al inicio, el elenco asiste a su segunda final seguida contra Tiburones para caer en siete reidos partidos.<br><br>El da 11 de Junio de 1971 fue creada la Fundacin Magallanes de Carabobo, organismo que a partir de esa fecha se encargara de dirigir todo lo relacionado con el equipo Navegantes del Magallanes.<br><br>1971-72:<br><br>An con un buen equipo, Magallanes queda fuera al perder por segunda vez en una tanda de desempate por el tercer y cuarto puesto, jugada contra La Guaira y Caracas. Ese ao Ivn Murrell, Jim Holt, Harold King y Clarence Gaston mantienen viva la tradicin del &quot;Poder Negro&quot;.<br><br>1972-73:<br><br>La escuadra marina firma un grupo de peloteros con la intencin de crear una base nativa. Alexis Ramrez, Flix Rodrguez, el lanzador carabobeo Jos Jimnez, Esteban Padrn, y un joven de 16 aos llamado Manuel Sarmiento son los novatos. El 15 de noviembre Bob Darwin conecta 3 cuadrangulares en juego contra el Aragua, y al finalizar la contienda establece un record al sacar 19 pelotas del parque, con jonrones realmente descomunales, muchos o ms de 400 pies de distancia del Home. Sin embargo su labor no fue suficiente para clasificar al club, toda vez que queda fuera por segundo ao seguido (tercero en total) en un mini play off de desempate por los lugares tres y cuatro contra Aragua y la Guaira.<br><br>1973-74:<br><br>El primer da del mes de enero de 1974, Mark Weems, para el momento lder de juegos salvados con 11, muere ahogado en las playas de Patanemo, en Puerto Cabello. Magallanes recopil marcas de 30 y 30 en un torneo que no fue concluido debido a una huelga de peloteros.<br><br>1974-75:<br><br>Ese ao estuvieron en las filas turcas Dave Parker, Don Baylor, Jim Holt, Kent Tekulve, Larry Demery y Wayne Garland, entre otras estrellas. El 22 de noviembre Parker suelta su segundo grand slam del ao. Parker se alza con los ttulos de jonrones y empujadas, al sacar 8 y fletar 50 rayitas. El 11 de enero comienza la primera confrotacin de post-temporada entre Magallanes y Caracas, de la cual sale favorecida la novena valenciana despus de siete reidos juegos, aunque en la final los bucaneros caen frente a los Tigres de Aragua cuatro juegos a dos.<br><br>1975-76:<br><br>Luego de finalizar en cuarto lugar, el equipo es derrotado en la semifinal por Cardenales de Lara, (4-2). Manuel Sarmiento alcanza el liderato de juegos salvados en la campaa (7).<br><br>1976-77:<br><br>Tras puntear la mayor parte del campeonato (el conjunto estuvo 82 das en la punta, hasta el 12 de enero cuando cae frente a las Aguilas del Zulia) Magallanes conquista el quinto ttulo de su historia doblegando a los Tiburones y queda segundo en la Serie del Caribe. Dave Parker finaliza como campen bate con .414 de promedio, la cifra ms alta de cualquier pelotero en la historia de nuestro Bisbol Profesional. Mitchell Page lidera las empujadas con 57, los jonrones con 14 y las bases alcanzadas con 140, y Flix Rodrguez suelta 10 triples, lo que se convierte en una nueva marca en la Liga.<br><br>1977-78:<br><br>Joe Cannon conquista el ttulo de bateo con .381, golpea 91 hits para encabezar ese departamento, e iguala la marca de triples con 10 (empatando el record establecido en la anterior campaa por el magallanero Flix Rodrguez), mientras que Oswaldo Olivares lidera a los robadores de bases con 25, en una temporada en la que Magallanes queda ltimo.<br><br>1978-79:<br><br>Magallanes conquista el ttulo gracias a una espectacular recuperacin encabezada por Willie Horton, quin en su doble rol de manager-jugador hizo pasar al club del ltimo al primer lugar de la tabla de clasificacin, para vencer a las guilas en la final. Olivares resulta lder en hits con 84 y Dave Coleman en dobles con 20. En la Serie del Caribe realizada en San Juan de Puerto rico, Magallanes logra su segundo ttulo regional, con Mitchell Page en plan de hroe al sonar jonrn decisivo en el noveno inning del ltimo juego.<br><br>1979-80:<br><br>Con indeseable marca de 48 derrotas en una temporada de 70 encuentros, Magallanes ocupa el ltimo lugar a 24 juegos y medio del puntero. Para colmo, el conjunto pierde los catorce juegos de la serie contra los Leones del Caracas y el Mnager Willie horton pasa de hroe a villano siendo cesanteado sucedindole en el cargo Luis Aparicio.<br><br>1980-81:<br><br>En la peor temporada de su historia, Magallanes queda con 16 ganados y 44 derrotas, una marca que ni siquiera los equipos de expansin han registrado. Alfredo Torres se embasa en 11 ocasiones consecutivamente y conecta de hit en ocho turnos seguidos, empatando la marca de la Liga.<br><br>1981-82:<br><br>Oswaldo Olivares es canjeado a los Tigres de Aragua por Carlos Porte y Victor Davalillo, y ste ltimo es dejado libre antes de iniciarse la campaa. Al final Magallanes queda en el stano por tercera ocasin seguida, y cuarta en las ltimas cinco campaas.<br><br>1982-83:<br><br>El equipo sale del stano pero no clasifica, pues queda en el quinto puesto con 31 y 34. El zurdo Randy Niemann cumple destacada labor desde el montculo, mientras que Alfredo Torres es lder en empujadas con 45 y bases alcanzadas con 111.<br><br>1983-84:<br><br>En medio de temporada el lanzador Manuel Sarmiento es cambiado por wolfgang Ramos y Roberto Espinoza al conjunto Tigres de Aragua. Billy Hatcher establece un record al embasarse en 40 juegos consecutivos en una temporada. Al final, apuntalados por los lanzadores Chris Green, lder en efectividad con 1.46, Mike Bielecki con 69 abanicados y Mike Anderson con 8 y 3, 4 completos y lder en comienzos con 15; y los jardineros Benny Distefano y Joe Orsulak, Magallanes logra el pase al play off al vencer a los Tigres de Aragua en juego extra por el cuarto lugar. Luego la tropa turca es barrida por las guilas del Zulia en la semifinal.<br><br>1984-85:<br><br>El 26 de octubre, en su primera apertura en nuestra pelota, Omar Bencomo mantuvo sin hits a La Guaira durante 8.1 innings, hasta que Norman Carrasco conect un inatrapable. De todas maneras Bencomo no solo termin lanzando un partido de un indiscutible, sino que a la postre obtuvo la designacin del &quot;Novato del Ao&quot; con balance de 7 y 3. Alfredo Torres lidera la Liga en carreras empujadas con 48. El 12 de enero Magallanes logra el cuarto lugar y clasifica al play-off, pero cae en cinco juegos frente a los Tigres de Aragua.<br><br>1985-86:<br><br>El 16 de noviembre Mark Funderburk conecta dos cuadrangulares en un mismo inning frente a los Leones, estableciendo un record. Barry Bonds, para el momento lder del equipo en jonrones, empujadas, anotadas y robos, es dejado en libertad a principios de diciembre. Sin embargo la novena cont con buen ataque y Joe Orsulak se erigi como campen bate (.331) y mximo hiteador (80); Funderburk fue el mximo empujador (41) y Benny Distefano hizo lo propio en triples (5). Al concluir la ronda eliminatoria Magallanes queda en el primer puesto (37 ganados y 28 perdidos, alcanzando de paso la mayor cantidad de triunfos para el club en una campaa), pero no pudo pasar a la final pues sucumbe ante Tiburones de La Guaira en cinco juegos.<br><br>1986-87:<br><br>Los novatos Carlos Garca, Jos Villa, Gilberto Roca, William Magallanes, Luis Vasquez y Clemente Alvarez son firmados como parte de un proceso de renovacin. Al principio de campaa el club experimenta una seguidilla adversa de 4 blanqueos consecutivos y 41 entradas sin fabricar anotaciones. El 6 de diciembre Magallanes establece un record de carreras al derrotar 23 a 0 a las Aguilas del Zulia, la mayor diferencia con la cual ha ganado un equipo en la Liga. Magallanes culmina eliminado y en el stano.<br><br>1987-88:<br><br>Magallanes experimenta una arrancada caliente y gana todos su partidos del mes de octubre, siete en total. El 28 de noviembre Billy Bean llega a once veces seguidas embasndose, para empatar la marca de la Liga. Jos Villa encabeza el circuito con 9 triunfos, para convertirse en el primer lanzador que lidera este departamento actuando solamente como relevista.  El equipo termina segundo, pero cae en el Round Robin.<br><br>1988-89:<br><br>Alfredo Torres es dejado libre al comienzo de la campaa, ese ao el equipo queda eliminado y en el stano, la ltima vez que esto ha ocurrido en nuestros campeonatos, entre otras cosas debido al anmico promedio de bateo colectivo de .229, el ms bajo del conjunto desde su regreso a la Liga en la 64-65.<br><br>1989-90:<br><br>Tras terminar liderando la clasificacin en la ronda eliminatoria, el conjunto se desinfla en el round robin, etapa en la cual inicia perdiendo nueve juegos seguidos, para concluir con negativa marca de uno y once. William Magallanes fue lder en jonrones con 8 y empujadas con 41. Edgar Naveda conecta ocho hits en ocho turnos consecutivos, con lo que empata el record de la Liga.<br><br>1990-91:<br><br>En planes de reestruccin, 14 peloteros son dejados libres por el conjunto. El 10 de noviembre, haciendo su debut en el profesional, Juan Francisco Castillo, gana su primer juego con trabajo de cinco captulos, rivalizando con Enrique Alfonso Gmez de Zulia. El da 13 de noviembre William Magallanes golpea con vuela cercas, uno con las bases llenas, el segundo grand slam para l en esa temporada. El 3 de enero Oswaldo Olivares conecta su primer cuadrangular en Venezuela despus suena su hit nmero 900 en la Liga. Durante el round robin Magallanes queda en el camino, pero Juan Francisco Castillo es designado &quot;Novato del Ao&quot;.<br><br>1991-92:<br><br>Antes del inicio de la campaa, Juan Carlos Pulido es obtenido de Tigres de Aragua a cambio de Alfredo Pedrique, quin haba llegado el ao anterior proveniente de los Tiburones por Luis Vsquez. El 2 de enero, en juego contra el Caracas que se extendi a 18 innings, Oswaldo Olivares larg un triple en el dcimo sptimo captulo, el incogible 950 en su carrera y el ltimo con el Magallanes en temporada regular, y Eric Anthony empata la marca de ms turnos en un juego en poder de &quot;Camalen Garca&quot; desde 1952-53 al acumular 9 veces al bate. El club culmina de primero en la recin creada divisin oriental, y aunque vuelve a quedar fuera de la final al caer en el round robin, algunos turcos reciben galardones: William Magallanes &quot;Productor del Ao&quot;, Benito Malav &quot;Relevista del Ao&quot;, y Eddy Daz &quot;Novato del Ao&quot;.<br><br>1992-93:<br><br>El grandeliga Alvaro Espinoza pasa al Magallanes junto con Ral &quot;Tucupita&quot; Marcano y Alfredo Torres (este ltimo dejado libre posteriormente), en cambio que llev a Lester Straker, Argenis Conde y Romn Rodrguez a los Tigres de Aragua. Aunque tuvo una mala arrancada (6 ganados y 14 perdidos), el 1 de diciembre Magallanes se ubica en el segundo puesto detrs de los Leones, gracias entre otras cosas a una cadena de 11 triunfos hilvanada del 10 al 25 de noviembre (la ms larga de la divisa en una campaa). El 23 de ese ltimo mes del ao el equipo asegura su pase al round robin venciendo a los Tiburones, y al culminar la campaa Carlos Garca experimenta una gran temporada: .354 de promedio, 3 jonrones, 23 empujadas, y 14 dobles, en medio de una actuacin colectiva desbordante. El club pasa a la final por primera vez en 14 temporadas, pero no cuenta con sus dos lanzadores estrellas, Juan Francisco Castillo y Ramn Garca, ni tampoco con el toletero Eric Anthony, siendo barrido en cuatro juegos por las Aguilas del Zulia.<br><br>1993-94:<br><br>Despus de quince aos de la obtencin de su ltimo ttulo (torneo 78-79), el 31 de enero de 1994 Magallanes volvi a ser campen del Bisbol venezolano tras derrotar a su eterno rival, Leones del Caracas, en una final esperada desde haca mucho tiempo y cuyas emociones se prolongaron al mximo de siete desafos. Los Navegantes, adems de llevarse el trapo campeonil, tuvieron en sus filas a varios de los peloteros ms destacados de la contienda. El lanzador zurdo Juan Carlos Pulido logr cosechar once triunfos en la ronda eliminatoria para erigirse en el &quot;Pitcher del Ao&quot;. El importado John Hudek coleccion 19 salvados en 20 oportunidades de rescate. Luis Raven, adquirido en una negociacin realizada con el Caracas antes de iniciar la campaa, se convirti en el &quot;Novato del Ao&quot;. Fue co-lder en jonrones (7) y segundo en average (.345), adems de figurar segundo detrs de Luis Sojo en la escogencia del &quot;Jugador Ms Valioso&quot;. El 5 de noviembre se produjo el debut de Alvaro Espinoza con la camiseta del club, y el 26 de noviembre el equipo realiz una importante transaccin que llev a William Magallanes a Caribes a cambio de Oscar Azcar, quin a la postre sera figura de primer orden en la conquista del campeonato.<br><br>1994-95:<br><br>Por primera vez desde al temporada 81-82, Magallanes cont con ms de un Manager en su direccin. Despus de haber comenzado con un ritmo muy ganador bajo el mando de Tim Tolman (17-10 hasta el momento en que el estratega tuvo que regresar a su pas), el conjunto se vino a menos en la segunda parte de la campaa con Dave Hudgens como piloto (15-18), perdiendo en la ltima jornada de la eliminatoria el primer lugar de la Divisin Oriental que haba ocupado durante toda la justa. Posteriormente en el round robin, y por cuarta ocasin en su historia, Los Navegantes fueron derrotados en una tanda de desempate entre tres equipos (contra Caracas y Zulia) de la cual salieron las dos novenas que iran a la final, tras perder el juego decisivo ante Leones. En el plano individual, Eddy Daz fue el lder estafador de la liga al acumular 23 robos.<br><br>1995-96:<br><br>A pesar de terminar con record negativo de 29 ganados y 31 perdidos durante la ronda eliminatoria (el segundo lugar de la Divisin Orienta a 3 juegos del Caracas), los Navegantes se crecieron a partir del round robin para terminar alzndose merecidamente con el ttulo del histrico torneo en el cual se celebr el 50 aniversario de la Liga Venezolana de Bisbol Profesional. Enfrentando en la final al Cardenales de Lara (equipo con el mejor record de la fase regular, 36 victorias y 24 derrotas), Magallanes se convirti apenas en el tercer club en la historia del circuito en obtener el gallardete despus de estar abajo 3 a 1 en la Serie decisiva, para lo cual tuvo que ir hasta Barquisimeto y en condicin de visitante vencer de manera sorpresiva en los dos ltimos cotejos. Con un conjunto que se bas casi en su totalidad en su material nativo, y que durante gran parte del round robin y la final present alineaciones conformadas exclusivamente por peloteros del patio, los Navegantes vinieron de atrs para lograr su segundo ttulo en tres temporadas. Dicho plantel, encabezado por el ms valioso de la final, Jos Francisco Malav (.370 de average con 3 jonrones y 10 impulsadas), el recuperado Juan Francisco Castillo (2 ganados y 0.60 de efectividad en un par de aperturas) y Gregorio Machado como manager de ltima hora ante la partida de Tim Tolman, le proporcion a la divisa su octavo ttulo en el rentado, corona sazonada con la garra mostrada por su base criolla. En el intern, Magallanes propin el primer juego sin hits ni carreras para el club, y el primero que se lanza en la Liga de manera combinada, cuando el 10 de enero Donne Wall, Oscar Henrquez y Dave Evans unieron esfuerzos para realizar tal hazaa frente a los mismos Cardenales.<br><br>1996-97:<br><br>Los Navegantes del Magallanes conquistaron su segunda corona consecutiva y la tercera en cuatro aos ratificando la hegemona establecida por la divisa en la dcada de los noventa. Tras terminar con el mejor registro de la ronda eliminatoria (33 y 17) y el todos contra todos (12 y 4), la nave accedi a su cuarta final en las ltimas cinco campaas, teniendo nuevamente como adverso a los Leones del Caracas. En esa instancia la escuadra dirigida por el Estadounidense John Tamargo fue totalmente superior, para en apenas cinco juegos salir una vez ms victoriosa en una fase decisiva frente a su eterno rival. Contando con el aporte de su brillante plantel nativo, en el cual sobresalieron Edgardo Alfonzo, Richard Hidalgo (ms valioso de la final) Ramn Garca, Luis Raven, Oscar Henriquez, Juan Carlos Pulido, Edgar Ramos, Juan Francisco Castillo y Alvaro Espinoza, Magallanes obtuvo el noveno ttulo de su historia y represent a Venezuela en la Serie del Caribe de Hermosillo, Mxico, donde qued en segundo lugar con balance de 3 y 3. En medio de la temporada regular, el 3 de noviembre el zurdo Chris Roberts entr en libro de los records al lanzar frente a los Tiburones de la Guaira el segundo juego sin hit ni carreras propinado por el Magallanes. El mismo Roberts estuvo cerca de completar una hazaa sin precedentes en nuestro Bisbol cuando el 8 de diciembre lanzo ocho innings y un tercio sin permitirle inatrapable a los tigres de Aragua, hasta que Jess &quot;Chalao&quot; Mndez acab con la posibilidad de otro no hit no run en la apertura del noveno. Por otra parte, esta versin del Magallanes implant un record para la franquicia en una temporada al propinar nueve blanqueos que fueron repartidos de la siguiente manera: tiburones (3), Caribes (2), Leones (1), Aguilas (1), Pastora (1) y Tigres (1).<br><br>1997-98:<br><br>Por segundo ao seguido Magallanes finaliz en el primer lugar de la Divisin Oriental con balance de 37 ganados y 27 perdidos, teniendo como principal baluarte el ataque desplegado por Luis Raven, quien fue el mximo remolcador de la campaa con 45 y co-lider en vuela cercas con 8, adems de hilvanar una cadena de 24 juegos conectando inatrapables, lo que constituye un record para la divisa. En el pitcheo destac el Zurdo norteamericano Rich Pratt, que fue el mayor ganador del club con 6 triunfos y termin con efectividad de 1.96, en el tercer mejor regstro del circuito en ese departamento. En el Round Robin el conjunto se vino a menos, tras comenzar con tres derrotas consecutivas no se pudo recuperar para terminar el tercer lugar con marca de ocho y ocho. En medio de etapa semifinal el manager Jhon Tamargo reunci a su cargo el dia 13 de enero, siendo sustituido por Alfredo Pedrique.<br>', '2013-04-23 15:27:39');
INSERT INTO `comments` VALUES ('248', '4', '1763', '184', '184', 'Los Navegantes del Magallanes fueron establecidos por primera vez en 1917 como el equipo Magallanes de Catia, entre sus fundadores aparecen resaltados Juan y Luis Carrat, la familia Fagre y los turcos Alberto y Ricardo Salomn, Vicente Issa y Eduardo Kalil. Luego, la Liga Nacional de Bisbol se establece en el ao de 1927, por ese motivo el equipo fue puesto en pie ya que se decidi organizar anualmente campeonatos de liga. Magallanes estaba listo para ingresar a su categora.<br><br>    El deporte se fue incrementando en el pas para dar origen a muchos equipos, entre los ms resaltantes aparecen Cervecera Caracas, Pastora, Gavilanes y el Royal Criollos. La mejor poca del bisbol en Venezuela estuvo comprendido entre los aos 44 y 50, cuando la pasin estall por parte del pblico dando a conocer como los equipos ms populares a Gavilanes, Magallanes y Cervecera Caracas.<br><br>    En este periodo el equipo Magallanes particip en ocho certmenes de primera divisin  logr capturar dos ttulos y dos subcampeonatos. Don Carlos Lavaud en 1941 compra al equipo y le da una nueva perspectiva, se comenzaban a realizar los navegantes de hoy en da, as, al crearse la Liga Profesional de Bisbol, Magallanes fue uno de cuatro equipos en participar en el primer torneo de 1946.<br><br><br>    El equipo dej de llamarse Magallanes para convertirse en la temporada del 1956 en Oriente y respectivamente luego en Orientales. Fue un nuevo paso para el equipo, un respiro momentneo para volver en el torneo 1964-1965.<br><br><br>    Mucho nos da de que hablar el equipo turco &quot;cariosamente llamado&quot;. Magallanes se vino a ms para conquistar seis gallardetes, los ms sobresalientes en los aos noventa contra su rival Caracas, estos se han enfrentado en dos nicas finales y Magallanes ha salido ganador. La ltima victoria fue en la temporada 96-97. Tiene 9 campeonatos y dos Series del Caribe en las ediciones de 1970 y 1979.<br><br> <br><br>1946:<br><br>En la primera Temporada de Bisbol Profesional Venezolano, Magallanes gana el primer juego celebrado en la Liga, venciendo al Venezuela el 12 de enero con score de 5 a 2. El equipo se apunta la primera carrera anotada en la pelota rentada por Luis Aparicio Ortega, el primer boleto recibido en el beisbol profesional, por Vidal Lpez, y el primer lanzador en obtener un triunfo, Alejandro Carrasquel. Ms adelante, Quincy Troupe dispara el primer cuadrangular del club y Vidal Lpez el primero como bateador emergente. Al final de la campaa algunos magallaneros atrapan lideratos individuales, como &quot;Chucho Ramos&quot;, lder en hits con 49 y en anotadas con 30. Mientras, Pablo Garca se coron monarca entre los bateadores con promedio de .403 puntos luego de 31 imparables en 77 visitas al plato.<br><br>1946-47:<br><br>Magallanes trae el primer importado con experiencia de Liga Mayor en la persona del lanzador Sam Nahem. El 12 de Abril Nahem lanza completo por dcima tercera oportunidad de manera consecutiva, estableciendo un record para nuestra liga que todava permanece vigente. Vidal Lpez termina como lder entre los jonroneros al sacar 6 pelotas del parque, y Nahem lidera los renglones de ms triunfos con 12, y ms bateadores abanicados con 114.<br><br>1947-48:<br><br>El club queda tercero a nueve juegos del ganador, pero Vidal Lpez, el primer dolo de Bisbol venezolano, logra capturar el ttulo de los bateadores con promedio de .374. Tambin empuja 32, da 11 dobles y 4 vuelacercas para ser seleccionado por el Crculo de Periodistas Deportivos como Pelotero del Ao.<br><br>1948-49:<br><br>Luego de liderar la tabla de posiciones durante la mayor parte del campeonato, Magallanes perdi sus dos ltimos desafos frente a Cervecera Caracas, equipo que le arrebat el ttulo dejndolo en segundo lugar. Jim Pendelton con 8 jonrones 25 impulsadas resulta el ms destacado del elenco turco.<br><br>1949-50:<br><br>Magallanes captura su primer gallardete, capitaneado por Lzaro Salazar &quot;El Prncipe de Beln&quot;, siendo el club que propin ms blanqueos en la campaa con 6. Theolic Smith comparte el liderato de juegos ganados con 8, Jim Pendelton es campen bate con .387 y mayor anotador con 47, mientras que Vidal Lpez es el mximo jonronero y remolcador con 9 y 43. El 17 de noviembre Luis &quot;Camalen &quot; Garca inicia una histrica seguidilla de juegos en nuestra Liga y es designado &quot;Novato del Ao&quot; al finalizar la contienda.<br><br>1950-51:<br><br>Magallanes repite el ttulo, apuntalando por los bates de Camalen Garca, Vidal Lpez, Jim Pendelton, Joe Monteiro y Johnny Davis y por el brazo de Clem Labine, quin gan 13 estableciendo una marca de ms triunfos contra un equipo en una misma temporada, al vencer al Cervecera Caracas.<br><br>1951-52:<br><br>El 14 de Febrero de 1952 en juego contra Cervecera Caracas, Camalen establece un record de turnos en un encuentro, al pararse en el Home en 9 oportunidades. Por su parte Johnny Hetki permaneci sobre el montculo durante los 18 episodios del mismo partido para fijar un record an vigente en el profesional. Al final los turcos quedan con 28 y 28 en segundo lugar.<br><br>1952-53:<br><br>Durante el primer partido de esa campaa entre Magallanes y los debutantes Leones del Caracas, el Pitcher turco Johnny Mackinson mantuvo sin hits a los felinos durante 10 innings y 2 tercios, hasta que Alfonso Carrasquel solt el primer indiscutible. Eso ocurri el 19 de Octubre, y despus de 13 entradas el match se decidi cuando Magallanes fabric 9 anotaciones para imponerse 10 a 1. Luis &quot;Camalen&quot; Garca alcanza los lideratos de jonrones (8) y empujadas (47). El 8 de enero Quincy Troupe estableci una marca al recibir 6 boletos en un solo partido. Esto fue ante el Caracas.<br><br>1953-54:<br><br>El 14 de octubre, Bill Taylor y George Wilson sacan cada uno dos para la calle, mientras Foster Castleman y Bill Gardner conectan uno por lado para ganar 8 a 2 al que se convertira en monarca de ese ao, el Pastora, en el llamado campeonato rotatorio, estableciendo un record para la Liga de seis cuadragunlares en un juego por un mismo equipo. Al final Magallanes llega segundo, pero Bill Taylor captura el ttulo de jonrones con 16 (incluyendo un juego con tres vuelacercas frente al Caracas el 24-01-54) y de remolcador con 63 implantando nuevos registros en ambos departamentos, mientras impuso las marcas an vigentes de ms bases alcanzadas en una Temporada con 162 y de ms turnos en una campaa con 308, cantidad que tambin consumi Castleman. Por su parte Camalen Garca logra su mejor palmars en nuestro Bisbol al alcanzar sus topes en juegos (78), turnos (307), carreras (54), hits (93), dobles (17), jonrones (11) y empujadas (50). Ramn Monzant resulta lder en ganados con 14 y en ponches con 132, a la vez que George Spencer implanta un record de juegos lanzados con 44. El club consume 2 mil 687 turnos oficiales en la temporada, un record para la Liga.  <br><br>1954-55:<br><br>Por tercer ao consecutivo un magallanero lidera la Liga en cuadrangulares y en remolcadas. Esta Vez Bob Lennon fue el mejor jonronero al sacar 9 mientras remolcaba 37. Por su parte Camalen Garca anota 32 para encabezar ese rengln, y Ramn Monzant es el mximo ganador y ponchador del circuito por segundo ao, con 11 triunfos y 96 abanicados, y segundo en efectividad con 2.00, superado slo por el Carrao Bracho (1.80). Magallanes obtiene su tercer gallardete protagonizando una increble recuperacin y se acredita el segundo ttulo de un equipo venezolano ante un campen cubano en Series del Caribe. Esto fue el 14 de Febrero de 1955 contra Alacranes de Almendares.<br><br>1955-56:<br><br>Esta fue la primera campaa del Magallanes sin Vidal Lpez, ya que un ao antes haba anunciado su retiro. El 8 de diciembre Magallanes recibe el primer no hit no run de nuestro Bisbol profesional. El victimario fue el lanzador Len Yochim de los Leones del Caracas. Ese ao los marinos naufragan en el mes de enero, a pesar de que Norman Larker obtuvo el ttulo de bateo (.340), Gale Wade los de hits (75), carreras anotadas (44) y bases robadas (11), y Ramn Monzant logr por tercer ao seguido los ttulos de ms ganador y mximo ponchador (10 y 119). Al terminar la temporada, ocurri una grave crisis econmica que sac al Magallanes de los torneos locales durante ocho campaas.<br><br>1964-65:<br><br>Antonio Jos Istriz se convierte en el nuevo dueo del club, Magallanes reaparece en el Bisbol para beneplcito de su amplia legin de fanticos. El 27 de noviembre de 1964 Luis &quot;Camalen&quot; Garca conecta tres imparables, los nmeros 900, 901 y 902 de su carrera. El 22 de enero Alfonso Carrasquel juega su ltimo partido como campocorto en Venezuela, con el uniforme del Magallanes. Al final el conjunto queda eliminado, aunque Camalen atrapa el liderato de bateadores al promediar .394 puntos.<br><br>1965-66:<br><br>El 15 de octubre, fecha inaugural del torneo, el novato Graciliano Parra mantuvo sin hits ni carreras por espacio de 9 innings y 2 tercios a Tiburones de la Guaira (campen de la 64-65 y a la postre tambin monarca de esta temporada), y apenas en el dcimo episodio el cubano Jos Martnez le conecta sencillo al centro. Al final Magallanes gana 1 a 0. El conjunto clasifica amparado en el bate de Tommy Agee, quin lider al club en casi todos los renglones ofensivos, pero al llegar el play-off cae ante Tiburones en el mximo de cinco juegos, pese a ganar los dos primeros desafos y ponerse a punto del pase a la final.<br><br>1966-67:<br><br>El 25 de octubre a la altura del quinto episodio, &quot;Camalen&quot; toma un turno frente al pitcher de Cardenales Ken Sanders y dispara un incogible, para convertirse en el primero que golpea mil hits en la pelota venezolana, justo cuando participaba en su dcima octava temporada profesional. De esta forma, el pelotero de Carpano daba otro paso hacia la inmortalidad. A pesar de quedar eliminados en un mini play-off de desempate por el tercer y cuarto lugar contra la Guaira y Valencia, destaca la labor desplegada por Gracialino Parra, quin deja balance de 7 y 3 con efectividad de 2.11; y el record establecido por Bill Connors al aparecer como relevista en 40 cotejos, en lo que tuvo 4 y 4 con 10 rescates y efectividad de 2.01.<br><br>1967-68:<br><br>El 30 de diciembre, frente a Cardenales de Lara, Isaas &quot;Ltigo&quot; Chvez obtiene su quinta victoria de la campaa, la ltima que lograra con la camiseta marina. El 13 de enero fue su ltima aparicin con el Magallanes antes de su muerte. El club concluye ltimo con balance de 21 y 39.<br><br>1968-69:<br><br>Son adquiridos Dmaso Blanco y Gustavo Gil, mientras que Pat Kelly y Clarence Gaston inician la tradicn del &quot;Poder Negro&quot;. El 24 de octubre el melenudo Howie Reed le propina no hit no run al Magallanes. Gaston establece un nuevo record de empujadas con 64, y tambin comanda la Liga en dobletes con 14 y bateo con .383, para convertirse en el &quot;Jugador Ms Valioso&quot;. Esta fue la ltima campaa de Camalen Garca con el Magallanes. El 16 de marzo de 1969, Isaa &quot;Ltigo&quot; Chvez, de 21 aos, fallece cuando el avin que lo llevaba al campo de entrenamiento de los Gigantes en Arizona se desploma justo al salir de Aeropuerto &quot;Grano de Oro&quot; en Maracaibo, acabando tambin con la vida de Carlos Santelz, pelotero del Cardenales de Lara, y del propietario de ese equipo, Don Antonio Herrera.<br><br>1969-70:<br><br>Magallanes es vendido a un grupo de personas de Carabobo y se muda para Valencia. Bajo la conduccin de Patato Pascual conquista su primer ttulo desde la campaa 1954-55, derrotando en esta ocasin a los Tiburones de la Guaira en solo tres juegos. A pesar de partir antes de finalizar la temporada, Gaston repite el ttulo de bateo con .360. Ese ao se vuelve a jugar la Serie del Caribe, y el escenario es el Estadio Universitario. Magallanes se apoya en el pitcheo y obtiene el primer ttulo del Caribe para un equipo venezolano, venciendo a los representantes de Repblica Dominicana y Puerto Rico.<br><br>1970-71:<br><br>El 27 de octubre se empata un record de la Liga (tro de jonrones en un inning) cuando Gustavo Gil conecta cuadrangular por el jardn izquierdo, Jim Holt por el centro y Harold King por el derecho durante el sexto inning de un partido jugado contra los Leones, lo que adems se convierte en toda una curiosidad por la reparticin del poder. El 14 de diciembre Herman Hill, outfielder importado, muere ahogado en la playa Guaicamacuto de Puerto Cabello, Magallanes logra una difcil clasificacin, apoyado en el bate de Jim Holt, quin remolca 38 anotaciones. Pese a no ser considerado como favorito al inicio, el elenco asiste a su segunda final seguida contra Tiburones para caer en siete reidos partidos.<br><br>El da 11 de Junio de 1971 fue creada la Fundacin Magallanes de Carabobo, organismo que a partir de esa fecha se encargara de dirigir todo lo relacionado con el equipo Navegantes del Magallanes.<br><br>1971-72:<br><br>An con un buen equipo, Magallanes queda fuera al perder por segunda vez en una tanda de desempate por el tercer y cuarto puesto, jugada contra La Guaira y Caracas. Ese ao Ivn Murrell, Jim Holt, Harold King y Clarence Gaston mantienen viva la tradicin del &quot;Poder Negro&quot;.<br><br>1972-73:<br><br>La escuadra marina firma un grupo de peloteros con la intencin de crear una base nativa. Alexis Ramrez, Flix Rodrguez, el lanzador carabobeo Jos Jimnez, Esteban Padrn, y un joven de 16 aos llamado Manuel Sarmiento son los novatos. El 15 de noviembre Bob Darwin conecta 3 cuadrangulares en juego contra el Aragua, y al finalizar la contienda establece un record al sacar 19 pelotas del parque, con jonrones realmente descomunales, muchos o ms de 400 pies de distancia del Home. Sin embargo su labor no fue suficiente para clasificar al club, toda vez que queda fuera por segundo ao seguido (tercero en total) en un mini play off de desempate por los lugares tres y cuatro contra Aragua y la Guaira.<br><br>1973-74:<br><br>El primer da del mes de enero de 1974, Mark Weems, para el momento lder de juegos salvados con 11, muere ahogado en las playas de Patanemo, en Puerto Cabello. Magallanes recopil marcas de 30 y 30 en un torneo que no fue concluido debido a una huelga de peloteros.<br><br>1974-75:<br><br>Ese ao estuvieron en las filas turcas Dave Parker, Don Baylor, Jim Holt, Kent Tekulve, Larry Demery y Wayne Garland, entre otras estrellas. El 22 de noviembre Parker suelta su segundo grand slam del ao. Parker se alza con los ttulos de jonrones y empujadas, al sacar 8 y fletar 50 rayitas. El 11 de enero comienza la primera confrotacin de post-temporada entre Magallanes y Caracas, de la cual sale favorecida la novena valenciana despus de siete reidos juegos, aunque en la final los bucaneros caen frente a los Tigres de Aragua cuatro juegos a dos.<br><br>1975-76:<br><br>Luego de finalizar en cuarto lugar, el equipo es derrotado en la semifinal por Cardenales de Lara, (4-2). Manuel Sarmiento alcanza el liderato de juegos salvados en la campaa (7).<br><br>1976-77:<br><br>Tras puntear la mayor parte del campeonato (el conjunto estuvo 82 das en la punta, hasta el 12 de enero cuando cae frente a las Aguilas del Zulia) Magallanes conquista el quinto ttulo de su historia doblegando a los Tiburones y queda segundo en la Serie del Caribe. Dave Parker finaliza como campen bate con .414 de promedio, la cifra ms alta de cualquier pelotero en la historia de nuestro Bisbol Profesional. Mitchell Page lidera las empujadas con 57, los jonrones con 14 y las bases alcanzadas con 140, y Flix Rodrguez suelta 10 triples, lo que se convierte en una nueva marca en la Liga.<br><br>1977-78:<br><br>Joe Cannon conquista el ttulo de bateo con .381, golpea 91 hits para encabezar ese departamento, e iguala la marca de triples con 10 (empatando el record establecido en la anterior campaa por el magallanero Flix Rodrguez), mientras que Oswaldo Olivares lidera a los robadores de bases con 25, en una temporada en la que Magallanes queda ltimo.<br><br>1978-79:<br><br>Magallanes conquista el ttulo gracias a una espectacular recuperacin encabezada por Willie Horton, quin en su doble rol de manager-jugador hizo pasar al club del ltimo al primer lugar de la tabla de clasificacin, para vencer a las guilas en la final. Olivares resulta lder en hits con 84 y Dave Coleman en dobles con 20. En la Serie del Caribe realizada en San Juan de Puerto rico, Magallanes logra su segundo ttulo regional, con Mitchell Page en plan de hroe al sonar jonrn decisivo en el noveno inning del ltimo juego.<br><br>1979-80:<br><br>Con indeseable marca de 48 derrotas en una temporada de 70 encuentros, Magallanes ocupa el ltimo lugar a 24 juegos y medio del puntero. Para colmo, el conjunto pierde los catorce juegos de la serie contra los Leones del Caracas y el Mnager Willie horton pasa de hroe a villano siendo cesanteado sucedindole en el cargo Luis Aparicio.<br><br>1980-81:<br><br>En la peor temporada de su historia, Magallanes queda con 16 ganados y 44 derrotas, una marca que ni siquiera los equipos de expansin han registrado. Alfredo Torres se embasa en 11 ocasiones consecutivamente y conecta de hit en ocho turnos seguidos, empatando la marca de la Liga.<br><br>1981-82:<br><br>Oswaldo Olivares es canjeado a los Tigres de Aragua por Carlos Porte y Victor Davalillo, y ste ltimo es dejado libre antes de iniciarse la campaa. Al final Magallanes queda en el stano por tercera ocasin seguida, y cuarta en las ltimas cinco campaas.<br><br>1982-83:<br><br>El equipo sale del stano pero no clasifica, pues queda en el quinto puesto con 31 y 34. El zurdo Randy Niemann cumple destacada labor desde el montculo, mientras que Alfredo Torres es lder en empujadas con 45 y bases alcanzadas con 111.<br><br>1983-84:<br><br>En medio de temporada el lanzador Manuel Sarmiento es cambiado por wolfgang Ramos y Roberto Espinoza al conjunto Tigres de Aragua. Billy Hatcher establece un record al embasarse en 40 juegos consecutivos en una temporada. Al final, apuntalados por los lanzadores Chris Green, lder en efectividad con 1.46, Mike Bielecki con 69 abanicados y Mike Anderson con 8 y 3, 4 completos y lder en comienzos con 15; y los jardineros Benny Distefano y Joe Orsulak, Magallanes logra el pase al play off al vencer a los Tigres de Aragua en juego extra por el cuarto lugar. Luego la tropa turca es barrida por las guilas del Zulia en la semifinal.<br><br>1984-85:<br><br>El 26 de octubre, en su primera apertura en nuestra pelota, Omar Bencomo mantuvo sin hits a La Guaira durante 8.1 innings, hasta que Norman Carrasco conect un inatrapable. De todas maneras Bencomo no solo termin lanzando un partido de un indiscutible, sino que a la postre obtuvo la designacin del &quot;Novato del Ao&quot; con balance de 7 y 3. Alfredo Torres lidera la Liga en carreras empujadas con 48. El 12 de enero Magallanes logra el cuarto lugar y clasifica al play-off, pero cae en cinco juegos frente a los Tigres de Aragua.<br><br>1985-86:<br><br>El 16 de noviembre Mark Funderburk conecta dos cuadrangulares en un mismo inning frente a los Leones, estableciendo un record. Barry Bonds, para el momento lder del equipo en jonrones, empujadas, anotadas y robos, es dejado en libertad a principios de diciembre. Sin embargo la novena cont con buen ataque y Joe Orsulak se erigi como campen bate (.331) y mximo hiteador (80); Funderburk fue el mximo empujador (41) y Benny Distefano hizo lo propio en triples (5). Al concluir la ronda eliminatoria Magallanes queda en el primer puesto (37 ganados y 28 perdidos, alcanzando de paso la mayor cantidad de triunfos para el club en una campaa), pero no pudo pasar a la final pues sucumbe ante Tiburones de La Guaira en cinco juegos.<br><br>1986-87:<br><br>Los novatos Carlos Garca, Jos Villa, Gilberto Roca, William Magallanes, Luis Vasquez y Clemente Alvarez son firmados como parte de un proceso de renovacin. Al principio de campaa el club experimenta una seguidilla adversa de 4 blanqueos consecutivos y 41 entradas sin fabricar anotaciones. El 6 de diciembre Magallanes establece un record de carreras al derrotar 23 a 0 a las Aguilas del Zulia, la mayor diferencia con la cual ha ganado un equipo en la Liga. Magallanes culmina eliminado y en el stano.<br><br>1987-88:<br><br>Magallanes experimenta una arrancada caliente y gana todos su partidos del mes de octubre, siete en total. El 28 de noviembre Billy Bean llega a once veces seguidas embasndose, para empatar la marca de la Liga. Jos Villa encabeza el circuito con 9 triunfos, para convertirse en el primer lanzador que lidera este departamento actuando solamente como relevista.  El equipo termina segundo, pero cae en el Round Robin.<br><br>1988-89:<br><br>Alfredo Torres es dejado libre al comienzo de la campaa, ese ao el equipo queda eliminado y en el stano, la ltima vez que esto ha ocurrido en nuestros campeonatos, entre otras cosas debido al anmico promedio de bateo colectivo de .229, el ms bajo del conjunto desde su regreso a la Liga en la 64-65.<br><br>1989-90:<br><br>Tras terminar liderando la clasificacin en la ronda eliminatoria, el conjunto se desinfla en el round robin, etapa en la cual inicia perdiendo nueve juegos seguidos, para concluir con negativa marca de uno y once. William Magallanes fue lder en jonrones con 8 y empujadas con 41. Edgar Naveda conecta ocho hits en ocho turnos consecutivos, con lo que empata el record de la Liga.<br><br>1990-91:<br><br>En planes de reestruccin, 14 peloteros son dejados libres por el conjunto. El 10 de noviembre, haciendo su debut en el profesional, Juan Francisco Castillo, gana su primer juego con trabajo de cinco captulos, rivalizando con Enrique Alfonso Gmez de Zulia. El da 13 de noviembre William Magallanes golpea con vuela cercas, uno con las bases llenas, el segundo grand slam para l en esa temporada. El 3 de enero Oswaldo Olivares conecta su primer cuadrangular en Venezuela despus suena su hit nmero 900 en la Liga. Durante el round robin Magallanes queda en el camino, pero Juan Francisco Castillo es designado &quot;Novato del Ao&quot;.<br><br>1991-92:<br><br>Antes del inicio de la campaa, Juan Carlos Pulido es obtenido de Tigres de Aragua a cambio de Alfredo Pedrique, quin haba llegado el ao anterior proveniente de los Tiburones por Luis Vsquez. El 2 de enero, en juego contra el Caracas que se extendi a 18 innings, Oswaldo Olivares larg un triple en el dcimo sptimo captulo, el incogible 950 en su carrera y el ltimo con el Magallanes en temporada regular, y Eric Anthony empata la marca de ms turnos en un juego en poder de &quot;Camalen Garca&quot; desde 1952-53 al acumular 9 veces al bate. El club culmina de primero en la recin creada divisin oriental, y aunque vuelve a quedar fuera de la final al caer en el round robin, algunos turcos reciben galardones: William Magallanes &quot;Productor del Ao&quot;, Benito Malav &quot;Relevista del Ao&quot;, y Eddy Daz &quot;Novato del Ao&quot;.<br><br>1992-93:<br><br>El grandeliga Alvaro Espinoza pasa al Magallanes junto con Ral &quot;Tucupita&quot; Marcano y Alfredo Torres (este ltimo dejado libre posteriormente), en cambio que llev a Lester Straker, Argenis Conde y Romn Rodrguez a los Tigres de Aragua. Aunque tuvo una mala arrancada (6 ganados y 14 perdidos), el 1 de diciembre Magallanes se ubica en el segundo puesto detrs de los Leones, gracias entre otras cosas a una cadena de 11 triunfos hilvanada del 10 al 25 de noviembre (la ms larga de la divisa en una campaa). El 23 de ese ltimo mes del ao el equipo asegura su pase al round robin venciendo a los Tiburones, y al culminar la campaa Carlos Garca experimenta una gran temporada: .354 de promedio, 3 jonrones, 23 empujadas, y 14 dobles, en medio de una actuacin colectiva desbordante. El club pasa a la final por primera vez en 14 temporadas, pero no cuenta con sus dos lanzadores estrellas, Juan Francisco Castillo y Ramn Garca, ni tampoco con el toletero Eric Anthony, siendo barrido en cuatro juegos por las Aguilas del Zulia.<br><br>1993-94:<br><br>Despus de quince aos de la obtencin de su ltimo ttulo (torneo 78-79), el 31 de enero de 1994 Magallanes volvi a ser campen del Bisbol venezolano tras derrotar a su eterno rival, Leones del Caracas, en una final esperada desde haca mucho tiempo y cuyas emociones se prolongaron al mximo de siete desafos. Los Navegantes, adems de llevarse el trapo campeonil, tuvieron en sus filas a varios de los peloteros ms destacados de la contienda. El lanzador zurdo Juan Carlos Pulido logr cosechar once triunfos en la ronda eliminatoria para erigirse en el &quot;Pitcher del Ao&quot;. El importado John Hudek coleccion 19 salvados en 20 oportunidades de rescate. Luis Raven, adquirido en una negociacin realizada con el Caracas antes de iniciar la campaa, se convirti en el &quot;Novato del Ao&quot;. Fue co-lder en jonrones (7) y segundo en average (.345), adems de figurar segundo detrs de Luis Sojo en la escogencia del &quot;Jugador Ms Valioso&quot;. El 5 de noviembre se produjo el debut de Alvaro Espinoza con la camiseta del club, y el 26 de noviembre el equipo realiz una importante transaccin que llev a William Magallanes a Caribes a cambio de Oscar Azcar, quin a la postre sera figura de primer orden en la conquista del campeonato.<br><br>1994-95:<br><br>Por primera vez desde al temporada 81-82, Magallanes cont con ms de un Manager en su direccin. Despus de haber comenzado con un ritmo muy ganador bajo el mando de Tim Tolman (17-10 hasta el momento en que el estratega tuvo que regresar a su pas), el conjunto se vino a menos en la segunda parte de la campaa con Dave Hudgens como piloto (15-18), perdiendo en la ltima jornada de la eliminatoria el primer lugar de la Divisin Oriental que haba ocupado durante toda la justa. Posteriormente en el round robin, y por cuarta ocasin en su historia, Los Navegantes fueron derrotados en una tanda de desempate entre tres equipos (contra Caracas y Zulia) de la cual salieron las dos novenas que iran a la final, tras perder el juego decisivo ante Leones. En el plano individual, Eddy Daz fue el lder estafador de la liga al acumular 23 robos.<br><br>1995-96:<br><br>A pesar de terminar con record negativo de 29 ganados y 31 perdidos durante la ronda eliminatoria (el segundo lugar de la Divisin Orienta a 3 juegos del Caracas), los Navegantes se crecieron a partir del round robin para terminar alzndose merecidamente con el ttulo del histrico torneo en el cual se celebr el 50 aniversario de la Liga Venezolana de Bisbol Profesional. Enfrentando en la final al Cardenales de Lara (equipo con el mejor record de la fase regular, 36 victorias y 24 derrotas), Magallanes se convirti apenas en el tercer club en la historia del circuito en obtener el gallardete despus de estar abajo 3 a 1 en la Serie decisiva, para lo cual tuvo que ir hasta Barquisimeto y en condicin de visitante vencer de manera sorpresiva en los dos ltimos cotejos. Con un conjunto que se bas casi en su totalidad en su material nativo, y que durante gran parte del round robin y la final present alineaciones conformadas exclusivamente por peloteros del patio, los Navegantes vinieron de atrs para lograr su segundo ttulo en tres temporadas. Dicho plantel, encabezado por el ms valioso de la final, Jos Francisco Malav (.370 de average con 3 jonrones y 10 impulsadas), el recuperado Juan Francisco Castillo (2 ganados y 0.60 de efectividad en un par de aperturas) y Gregorio Machado como manager de ltima hora ante la partida de Tim Tolman, le proporcion a la divisa su octavo ttulo en el rentado, corona sazonada con la garra mostrada por su base criolla. En el intern, Magallanes propin el primer juego sin hits ni carreras para el club, y el primero que se lanza en la Liga de manera combinada, cuando el 10 de enero Donne Wall, Oscar Henrquez y Dave Evans unieron esfuerzos para realizar tal hazaa frente a los mismos Cardenales.<br><br>1996-97:<br><br>Los Navegantes del Magallanes conquistaron su segunda corona consecutiva y la tercera en cuatro aos ratificando la hegemona establecida por la divisa en la dcada de los noventa. Tras terminar con el mejor registro de la ronda eliminatoria (33 y 17) y el todos contra todos (12 y 4), la nave accedi a su cuarta final en las ltimas cinco campaas, teniendo nuevamente como adverso a los Leones del Caracas. En esa instancia la escuadra dirigida por el Estadounidense John Tamargo fue totalmente superior, para en apenas cinco juegos salir una vez ms victoriosa en una fase decisiva frente a su eterno rival. Contando con el aporte de su brillante plantel nativo, en el cual sobresalieron Edgardo Alfonzo, Richard Hidalgo (ms valioso de la final) Ramn Garca, Luis Raven, Oscar Henriquez, Juan Carlos Pulido, Edgar Ramos, Juan Francisco Castillo y Alvaro Espinoza, Magallanes obtuvo el noveno ttulo de su historia y represent a Venezuela en la Serie del Caribe de Hermosillo, Mxico, donde qued en segundo lugar con balance de 3 y 3. En medio de la temporada regular, el 3 de noviembre el zurdo Chris Roberts entr en libro de los records al lanzar frente a los Tiburones de la Guaira el segundo juego sin hit ni carreras propinado por el Magallanes. El mismo Roberts estuvo cerca de completar una hazaa sin precedentes en nuestro Bisbol cuando el 8 de diciembre lanzo ocho innings y un tercio sin permitirle inatrapable a los tigres de Aragua, hasta que Jess &quot;Chalao&quot; Mndez acab con la posibilidad de otro no hit no run en la apertura del noveno. Por otra parte, esta versin del Magallanes implant un record para la franquicia en una temporada al propinar nueve blanqueos que fueron repartidos de la siguiente manera: tiburones (3), Caribes (2), Leones (1), Aguilas (1), Pastora (1) y Tigres (1).<br><br>1997-98:<br><br>Por segundo ao seguido Magallanes finaliz en el primer lugar de la Divisin Oriental con balance de 37 ganados y 27 perdidos, teniendo como principal baluarte el ataque desplegado por Luis Raven, quien fue el mximo remolcador de la campaa con 45 y co-lider en vuela cercas con 8, adems de hilvanar una cadena de 24 juegos conectando inatrapables, lo que constituye un record para la divisa. En el pitcheo destac el Zurdo norteamericano Rich Pratt, que fue el mayor ganador del club con 6 triunfos y termin con efectividad de 1.96, en el tercer mejor regstro del circuito en ese departamento. En el Round Robin el conjunto se vino a menos, tras comenzar con tres derrotas consecutivas no se pudo recuperar para terminar el tercer lugar con marca de ocho y ocho. En medio de etapa semifinal el manager Jhon Tamargo reunci a su cargo el dia 13 de enero, siendo sustituido por Alfredo Pedrique.<br>', '2013-04-23 15:27:36');
INSERT INTO `comments` VALUES ('250', '4', '1763', '184', '184', 'Los Navegantes del Magallanes fueron establecidos por primera vez en 1917 como el equipo Magallanes de Catia, entre sus fundadores aparecen resaltados Juan y Luis Carrat, la familia Fagre y los turcos Alberto y Ricardo Salomn, Vicente Issa y Eduardo Kalil. Luego, la Liga Nacional de Bisbol se establece en el ao de 1927, por ese motivo el equipo fue puesto en pie ya que se decidi organizar anualmente campeonatos de liga. Magallanes estaba listo para ingresar a su categora.<br><br>    El deporte se fue incrementando en el pas para dar origen a muchos equipos, entre los ms resaltantes aparecen Cervecera Caracas, Pastora, Gavilanes y el Royal Criollos. La mejor poca del bisbol en Venezuela estuvo comprendido entre los aos 44 y 50, cuando la pasin estall por parte del pblico dando a conocer como los equipos ms populares a Gavilanes, Magallanes y Cervecera Caracas.<br><br>    En este periodo el equipo Magallanes particip en ocho certmenes de primera divisin  logr capturar dos ttulos y dos subcampeonatos. Don Carlos Lavaud en 1941 compra al equipo y le da una nueva perspectiva, se comenzaban a realizar los navegantes de hoy en da, as, al crearse la Liga Profesional de Bisbol, Magallanes fue uno de cuatro equipos en participar en el primer torneo de 1946.<br><br><br>    El equipo dej de llamarse Magallanes para convertirse en la temporada del 1956 en Oriente y respectivamente luego en Orientales. Fue un nuevo paso para el equipo, un respiro momentneo para volver en el torneo 1964-1965.<br><br><br>    Mucho nos da de que hablar el equipo turco &quot;cariosamente llamado&quot;. Magallanes se vino a ms para conquistar seis gallardetes, los ms sobresalientes en los aos noventa contra su rival Caracas, estos se han enfrentado en dos nicas finales y Magallanes ha salido ganador. La ltima victoria fue en la temporada 96-97. Tiene 9 campeonatos y dos Series del Caribe en las ediciones de 1970 y 1979.<br><br> <br><br>1946:<br><br>En la primera Temporada de Bisbol Profesional Venezolano, Magallanes gana el primer juego celebrado en la Liga, venciendo al Venezuela el 12 de enero con score de 5 a 2. El equipo se apunta la primera carrera anotada en la pelota rentada por Luis Aparicio Ortega, el primer boleto recibido en el beisbol profesional, por Vidal Lpez, y el primer lanzador en obtener un triunfo, Alejandro Carrasquel. Ms adelante, Quincy Troupe dispara el primer cuadrangular del club y Vidal Lpez el primero como bateador emergente. Al final de la campaa algunos magallaneros atrapan lideratos individuales, como &quot;Chucho Ramos&quot;, lder en hits con 49 y en anotadas con 30. Mientras, Pablo Garca se coron monarca entre los bateadores con promedio de .403 puntos luego de 31 imparables en 77 visitas al plato.<br><br>1946-47:<br><br>Magallanes trae el primer importado con experiencia de Liga Mayor en la persona del lanzador Sam Nahem. El 12 de Abril Nahem lanza completo por dcima tercera oportunidad de manera consecutiva, estableciendo un record para nuestra liga que todava permanece vigente. Vidal Lpez termina como lder entre los jonroneros al sacar 6 pelotas del parque, y Nahem lidera los renglones de ms triunfos con 12, y ms bateadores abanicados con 114.<br><br>1947-48:<br><br>El club queda tercero a nueve juegos del ganador, pero Vidal Lpez, el primer dolo de Bisbol venezolano, logra capturar el ttulo de los bateadores con promedio de .374. Tambin empuja 32, da 11 dobles y 4 vuelacercas para ser seleccionado por el Crculo de Periodistas Deportivos como Pelotero del Ao.<br><br>1948-49:<br><br>Luego de liderar la tabla de posiciones durante la mayor parte del campeonato, Magallanes perdi sus dos ltimos desafos frente a Cervecera Caracas, equipo que le arrebat el ttulo dejndolo en segundo lugar. Jim Pendelton con 8 jonrones 25 impulsadas resulta el ms destacado del elenco turco.<br><br>1949-50:<br><br>Magallanes captura su primer gallardete, capitaneado por Lzaro Salazar &quot;El Prncipe de Beln&quot;, siendo el club que propin ms blanqueos en la campaa con 6. Theolic Smith comparte el liderato de juegos ganados con 8, Jim Pendelton es campen bate con .387 y mayor anotador con 47, mientras que Vidal Lpez es el mximo jonronero y remolcador con 9 y 43. El 17 de noviembre Luis &quot;Camalen &quot; Garca inicia una histrica seguidilla de juegos en nuestra Liga y es designado &quot;Novato del Ao&quot; al finalizar la contienda.<br><br>1950-51:<br><br>Magallanes repite el ttulo, apuntalando por los bates de Camalen Garca, Vidal Lpez, Jim Pendelton, Joe Monteiro y Johnny Davis y por el brazo de Clem Labine, quin gan 13 estableciendo una marca de ms triunfos contra un equipo en una misma temporada, al vencer al Cervecera Caracas.<br><br>1951-52:<br><br>El 14 de Febrero de 1952 en juego contra Cervecera Caracas, Camalen establece un record de turnos en un encuentro, al pararse en el Home en 9 oportunidades. Por su parte Johnny Hetki permaneci sobre el montculo durante los 18 episodios del mismo partido para fijar un record an vigente en el profesional. Al final los turcos quedan con 28 y 28 en segundo lugar.<br><br>1952-53:<br><br>Durante el primer partido de esa campaa entre Magallanes y los debutantes Leones del Caracas, el Pitcher turco Johnny Mackinson mantuvo sin hits a los felinos durante 10 innings y 2 tercios, hasta que Alfonso Carrasquel solt el primer indiscutible. Eso ocurri el 19 de Octubre, y despus de 13 entradas el match se decidi cuando Magallanes fabric 9 anotaciones para imponerse 10 a 1. Luis &quot;Camalen&quot; Garca alcanza los lideratos de jonrones (8) y empujadas (47). El 8 de enero Quincy Troupe estableci una marca al recibir 6 boletos en un solo partido. Esto fue ante el Caracas.<br><br>1953-54:<br><br>El 14 de octubre, Bill Taylor y George Wilson sacan cada uno dos para la calle, mientras Foster Castleman y Bill Gardner conectan uno por lado para ganar 8 a 2 al que se convertira en monarca de ese ao, el Pastora, en el llamado campeonato rotatorio, estableciendo un record para la Liga de seis cuadragunlares en un juego por un mismo equipo. Al final Magallanes llega segundo, pero Bill Taylor captura el ttulo de jonrones con 16 (incluyendo un juego con tres vuelacercas frente al Caracas el 24-01-54) y de remolcador con 63 implantando nuevos registros en ambos departamentos, mientras impuso las marcas an vigentes de ms bases alcanzadas en una Temporada con 162 y de ms turnos en una campaa con 308, cantidad que tambin consumi Castleman. Por su parte Camalen Garca logra su mejor palmars en nuestro Bisbol al alcanzar sus topes en juegos (78), turnos (307), carreras (54), hits (93), dobles (17), jonrones (11) y empujadas (50). Ramn Monzant resulta lder en ganados con 14 y en ponches con 132, a la vez que George Spencer implanta un record de juegos lanzados con 44. El club consume 2 mil 687 turnos oficiales en la temporada, un record para la Liga.  <br><br>1954-55:<br><br>Por tercer ao consecutivo un magallanero lidera la Liga en cuadrangulares y en remolcadas. Esta Vez Bob Lennon fue el mejor jonronero al sacar 9 mientras remolcaba 37. Por su parte Camalen Garca anota 32 para encabezar ese rengln, y Ramn Monzant es el mximo ganador y ponchador del circuito por segundo ao, con 11 triunfos y 96 abanicados, y segundo en efectividad con 2.00, superado slo por el Carrao Bracho (1.80). Magallanes obtiene su tercer gallardete protagonizando una increble recuperacin y se acredita el segundo ttulo de un equipo venezolano ante un campen cubano en Series del Caribe. Esto fue el 14 de Febrero de 1955 contra Alacranes de Almendares.<br><br>1955-56:<br><br>Esta fue la primera campaa del Magallanes sin Vidal Lpez, ya que un ao antes haba anunciado su retiro. El 8 de diciembre Magallanes recibe el primer no hit no run de nuestro Bisbol profesional. El victimario fue el lanzador Len Yochim de los Leones del Caracas. Ese ao los marinos naufragan en el mes de enero, a pesar de que Norman Larker obtuvo el ttulo de bateo (.340), Gale Wade los de hits (75), carreras anotadas (44) y bases robadas (11), y Ramn Monzant logr por tercer ao seguido los ttulos de ms ganador y mximo ponchador (10 y 119). Al terminar la temporada, ocurri una grave crisis econmica que sac al Magallanes de los torneos locales durante ocho campaas.<br><br>1964-65:<br><br>Antonio Jos Istriz se convierte en el nuevo dueo del club, Magallanes reaparece en el Bisbol para beneplcito de su amplia legin de fanticos. El 27 de noviembre de 1964 Luis &quot;Camalen&quot; Garca conecta tres imparables, los nmeros 900, 901 y 902 de su carrera. El 22 de enero Alfonso Carrasquel juega su ltimo partido como campocorto en Venezuela, con el uniforme del Magallanes. Al final el conjunto queda eliminado, aunque Camalen atrapa el liderato de bateadores al promediar .394 puntos.<br><br>1965-66:<br><br>El 15 de octubre, fecha inaugural del torneo, el novato Graciliano Parra mantuvo sin hits ni carreras por espacio de 9 innings y 2 tercios a Tiburones de la Guaira (campen de la 64-65 y a la postre tambin monarca de esta temporada), y apenas en el dcimo episodio el cubano Jos Martnez le conecta sencillo al centro. Al final Magallanes gana 1 a 0. El conjunto clasifica amparado en el bate de Tommy Agee, quin lider al club en casi todos los renglones ofensivos, pero al llegar el play-off cae ante Tiburones en el mximo de cinco juegos, pese a ganar los dos primeros desafos y ponerse a punto del pase a la final.<br><br>1966-67:<br><br>El 25 de octubre a la altura del quinto episodio, &quot;Camalen&quot; toma un turno frente al pitcher de Cardenales Ken Sanders y dispara un incogible, para convertirse en el primero que golpea mil hits en la pelota venezolana, justo cuando participaba en su dcima octava temporada profesional. De esta forma, el pelotero de Carpano daba otro paso hacia la inmortalidad. A pesar de quedar eliminados en un mini play-off de desempate por el tercer y cuarto lugar contra la Guaira y Valencia, destaca la labor desplegada por Gracialino Parra, quin deja balance de 7 y 3 con efectividad de 2.11; y el record establecido por Bill Connors al aparecer como relevista en 40 cotejos, en lo que tuvo 4 y 4 con 10 rescates y efectividad de 2.01.<br><br>1967-68:<br><br>El 30 de diciembre, frente a Cardenales de Lara, Isaas &quot;Ltigo&quot; Chvez obtiene su quinta victoria de la campaa, la ltima que lograra con la camiseta marina. El 13 de enero fue su ltima aparicin con el Magallanes antes de su muerte. El club concluye ltimo con balance de 21 y 39.<br><br>1968-69:<br><br>Son adquiridos Dmaso Blanco y Gustavo Gil, mientras que Pat Kelly y Clarence Gaston inician la tradicn del &quot;Poder Negro&quot;. El 24 de octubre el melenudo Howie Reed le propina no hit no run al Magallanes. Gaston establece un nuevo record de empujadas con 64, y tambin comanda la Liga en dobletes con 14 y bateo con .383, para convertirse en el &quot;Jugador Ms Valioso&quot;. Esta fue la ltima campaa de Camalen Garca con el Magallanes. El 16 de marzo de 1969, Isaa &quot;Ltigo&quot; Chvez, de 21 aos, fallece cuando el avin que lo llevaba al campo de entrenamiento de los Gigantes en Arizona se desploma justo al salir de Aeropuerto &quot;Grano de Oro&quot; en Maracaibo, acabando tambin con la vida de Carlos Santelz, pelotero del Cardenales de Lara, y del propietario de ese equipo, Don Antonio Herrera.<br><br>1969-70:<br><br>Magallanes es vendido a un grupo de personas de Carabobo y se muda para Valencia. Bajo la conduccin de Patato Pascual conquista su primer ttulo desde la campaa 1954-55, derrotando en esta ocasin a los Tiburones de la Guaira en solo tres juegos. A pesar de partir antes de finalizar la temporada, Gaston repite el ttulo de bateo con .360. Ese ao se vuelve a jugar la Serie del Caribe, y el escenario es el Estadio Universitario. Magallanes se apoya en el pitcheo y obtiene el primer ttulo del Caribe para un equipo venezolano, venciendo a los representantes de Repblica Dominicana y Puerto Rico.<br><br>1970-71:<br><br>El 27 de octubre se empata un record de la Liga (tro de jonrones en un inning) cuando Gustavo Gil conecta cuadrangular por el jardn izquierdo, Jim Holt por el centro y Harold King por el derecho durante el sexto inning de un partido jugado contra los Leones, lo que adems se convierte en toda una curiosidad por la reparticin del poder. El 14 de diciembre Herman Hill, outfielder importado, muere ahogado en la playa Guaicamacuto de Puerto Cabello, Magallanes logra una difcil clasificacin, apoyado en el bate de Jim Holt, quin remolca 38 anotaciones. Pese a no ser considerado como favorito al inicio, el elenco asiste a su segunda final seguida contra Tiburones para caer en siete reidos partidos.<br><br>El da 11 de Junio de 1971 fue creada la Fundacin Magallanes de Carabobo, organismo que a partir de esa fecha se encargara de dirigir todo lo relacionado con el equipo Navegantes del Magallanes.<br><br>1971-72:<br><br>An con un buen equipo, Magallanes queda fuera al perder por segunda vez en una tanda de desempate por el tercer y cuarto puesto, jugada contra La Guaira y Caracas. Ese ao Ivn Murrell, Jim Holt, Harold King y Clarence Gaston mantienen viva la tradicin del &quot;Poder Negro&quot;.<br><br>1972-73:<br><br>La escuadra marina firma un grupo de peloteros con la intencin de crear una base nativa. Alexis Ramrez, Flix Rodrguez, el lanzador carabobeo Jos Jimnez, Esteban Padrn, y un joven de 16 aos llamado Manuel Sarmiento son los novatos. El 15 de noviembre Bob Darwin conecta 3 cuadrangulares en juego contra el Aragua, y al finalizar la contienda establece un record al sacar 19 pelotas del parque, con jonrones realmente descomunales, muchos o ms de 400 pies de distancia del Home. Sin embargo su labor no fue suficiente para clasificar al club, toda vez que queda fuera por segundo ao seguido (tercero en total) en un mini play off de desempate por los lugares tres y cuatro contra Aragua y la Guaira.<br><br>1973-74:<br><br>El primer da del mes de enero de 1974, Mark Weems, para el momento lder de juegos salvados con 11, muere ahogado en las playas de Patanemo, en Puerto Cabello. Magallanes recopil marcas de 30 y 30 en un torneo que no fue concluido debido a una huelga de peloteros.<br><br>1974-75:<br><br>Ese ao estuvieron en las filas turcas Dave Parker, Don Baylor, Jim Holt, Kent Tekulve, Larry Demery y Wayne Garland, entre otras estrellas. El 22 de noviembre Parker suelta su segundo grand slam del ao. Parker se alza con los ttulos de jonrones y empujadas, al sacar 8 y fletar 50 rayitas. El 11 de enero comienza la primera confrotacin de post-temporada entre Magallanes y Caracas, de la cual sale favorecida la novena valenciana despus de siete reidos juegos, aunque en la final los bucaneros caen frente a los Tigres de Aragua cuatro juegos a dos.<br><br>1975-76:<br><br>Luego de finalizar en cuarto lugar, el equipo es derrotado en la semifinal por Cardenales de Lara, (4-2). Manuel Sarmiento alcanza el liderato de juegos salvados en la campaa (7).<br><br>1976-77:<br><br>Tras puntear la mayor parte del campeonato (el conjunto estuvo 82 das en la punta, hasta el 12 de enero cuando cae frente a las Aguilas del Zulia) Magallanes conquista el quinto ttulo de su historia doblegando a los Tiburones y queda segundo en la Serie del Caribe. Dave Parker finaliza como campen bate con .414 de promedio, la cifra ms alta de cualquier pelotero en la historia de nuestro Bisbol Profesional. Mitchell Page lidera las empujadas con 57, los jonrones con 14 y las bases alcanzadas con 140, y Flix Rodrguez suelta 10 triples, lo que se convierte en una nueva marca en la Liga.<br><br>1977-78:<br><br>Joe Cannon conquista el ttulo de bateo con .381, golpea 91 hits para encabezar ese departamento, e iguala la marca de triples con 10 (empatando el record establecido en la anterior campaa por el magallanero Flix Rodrguez), mientras que Oswaldo Olivares lidera a los robadores de bases con 25, en una temporada en la que Magallanes queda ltimo.<br><br>1978-79:<br><br>Magallanes conquista el ttulo gracias a una espectacular recuperacin encabezada por Willie Horton, quin en su doble rol de manager-jugador hizo pasar al club del ltimo al primer lugar de la tabla de clasificacin, para vencer a las guilas en la final. Olivares resulta lder en hits con 84 y Dave Coleman en dobles con 20. En la Serie del Caribe realizada en San Juan de Puerto rico, Magallanes logra su segundo ttulo regional, con Mitchell Page en plan de hroe al sonar jonrn decisivo en el noveno inning del ltimo juego.<br><br>1979-80:<br><br>Con indeseable marca de 48 derrotas en una temporada de 70 encuentros, Magallanes ocupa el ltimo lugar a 24 juegos y medio del puntero. Para colmo, el conjunto pierde los catorce juegos de la serie contra los Leones del Caracas y el Mnager Willie horton pasa de hroe a villano siendo cesanteado sucedindole en el cargo Luis Aparicio.<br><br>1980-81:<br><br>En la peor temporada de su historia, Magallanes queda con 16 ganados y 44 derrotas, una marca que ni siquiera los equipos de expansin han registrado. Alfredo Torres se embasa en 11 ocasiones consecutivamente y conecta de hit en ocho turnos seguidos, empatando la marca de la Liga.<br><br>1981-82:<br><br>Oswaldo Olivares es canjeado a los Tigres de Aragua por Carlos Porte y Victor Davalillo, y ste ltimo es dejado libre antes de iniciarse la campaa. Al final Magallanes queda en el stano por tercera ocasin seguida, y cuarta en las ltimas cinco campaas.<br><br>1982-83:<br><br>El equipo sale del stano pero no clasifica, pues queda en el quinto puesto con 31 y 34. El zurdo Randy Niemann cumple destacada labor desde el montculo, mientras que Alfredo Torres es lder en empujadas con 45 y bases alcanzadas con 111.<br><br>1983-84:<br><br>En medio de temporada el lanzador Manuel Sarmiento es cambiado por wolfgang Ramos y Roberto Espinoza al conjunto Tigres de Aragua. Billy Hatcher establece un record al embasarse en 40 juegos consecutivos en una temporada. Al final, apuntalados por los lanzadores Chris Green, lder en efectividad con 1.46, Mike Bielecki con 69 abanicados y Mike Anderson con 8 y 3, 4 completos y lder en comienzos con 15; y los jardineros Benny Distefano y Joe Orsulak, Magallanes logra el pase al play off al vencer a los Tigres de Aragua en juego extra por el cuarto lugar. Luego la tropa turca es barrida por las guilas del Zulia en la semifinal.<br><br>1984-85:<br><br>El 26 de octubre, en su primera apertura en nuestra pelota, Omar Bencomo mantuvo sin hits a La Guaira durante 8.1 innings, hasta que Norman Carrasco conect un inatrapable. De todas maneras Bencomo no solo termin lanzando un partido de un indiscutible, sino que a la postre obtuvo la designacin del &quot;Novato del Ao&quot; con balance de 7 y 3. Alfredo Torres lidera la Liga en carreras empujadas con 48. El 12 de enero Magallanes logra el cuarto lugar y clasifica al play-off, pero cae en cinco juegos frente a los Tigres de Aragua.<br><br>1985-86:<br><br>El 16 de noviembre Mark Funderburk conecta dos cuadrangulares en un mismo inning frente a los Leones, estableciendo un record. Barry Bonds, para el momento lder del equipo en jonrones, empujadas, anotadas y robos, es dejado en libertad a principios de diciembre. Sin embargo la novena cont con buen ataque y Joe Orsulak se erigi como campen bate (.331) y mximo hiteador (80); Funderburk fue el mximo empujador (41) y Benny Distefano hizo lo propio en triples (5). Al concluir la ronda eliminatoria Magallanes queda en el primer puesto (37 ganados y 28 perdidos, alcanzando de paso la mayor cantidad de triunfos para el club en una campaa), pero no pudo pasar a la final pues sucumbe ante Tiburones de La Guaira en cinco juegos.<br><br>1986-87:<br><br>Los novatos Carlos Garca, Jos Villa, Gilberto Roca, William Magallanes, Luis Vasquez y Clemente Alvarez son firmados como parte de un proceso de renovacin. Al principio de campaa el club experimenta una seguidilla adversa de 4 blanqueos consecutivos y 41 entradas sin fabricar anotaciones. El 6 de diciembre Magallanes establece un record de carreras al derrotar 23 a 0 a las Aguilas del Zulia, la mayor diferencia con la cual ha ganado un equipo en la Liga. Magallanes culmina eliminado y en el stano.<br><br>1987-88:<br><br>Magallanes experimenta una arrancada caliente y gana todos su partidos del mes de octubre, siete en total. El 28 de noviembre Billy Bean llega a once veces seguidas embasndose, para empatar la marca de la Liga. Jos Villa encabeza el circuito con 9 triunfos, para convertirse en el primer lanzador que lidera este departamento actuando solamente como relevista.  El equipo termina segundo, pero cae en el Round Robin.<br><br>1988-89:<br><br>Alfredo Torres es dejado libre al comienzo de la campaa, ese ao el equipo queda eliminado y en el stano, la ltima vez que esto ha ocurrido en nuestros campeonatos, entre otras cosas debido al anmico promedio de bateo colectivo de .229, el ms bajo del conjunto desde su regreso a la Liga en la 64-65.<br><br>1989-90:<br><br>Tras terminar liderando la clasificacin en la ronda eliminatoria, el conjunto se desinfla en el round robin, etapa en la cual inicia perdiendo nueve juegos seguidos, para concluir con negativa marca de uno y once. William Magallanes fue lder en jonrones con 8 y empujadas con 41. Edgar Naveda conecta ocho hits en ocho turnos consecutivos, con lo que empata el record de la Liga.<br><br>1990-91:<br><br>En planes de reestruccin, 14 peloteros son dejados libres por el conjunto. El 10 de noviembre, haciendo su debut en el profesional, Juan Francisco Castillo, gana su primer juego con trabajo de cinco captulos, rivalizando con Enrique Alfonso Gmez de Zulia. El da 13 de noviembre William Magallanes golpea con vuela cercas, uno con las bases llenas, el segundo grand slam para l en esa temporada. El 3 de enero Oswaldo Olivares conecta su primer cuadrangular en Venezuela despus suena su hit nmero 900 en la Liga. Durante el round robin Magallanes queda en el camino, pero Juan Francisco Castillo es designado &quot;Novato del Ao&quot;.<br><br>1991-92:<br><br>Antes del inicio de la campaa, Juan Carlos Pulido es obtenido de Tigres de Aragua a cambio de Alfredo Pedrique, quin haba llegado el ao anterior proveniente de los Tiburones por Luis Vsquez. El 2 de enero, en juego contra el Caracas que se extendi a 18 innings, Oswaldo Olivares larg un triple en el dcimo sptimo captulo, el incogible 950 en su carrera y el ltimo con el Magallanes en temporada regular, y Eric Anthony empata la marca de ms turnos en un juego en poder de &quot;Camalen Garca&quot; desde 1952-53 al acumular 9 veces al bate. El club culmina de primero en la recin creada divisin oriental, y aunque vuelve a quedar fuera de la final al caer en el round robin, algunos turcos reciben galardones: William Magallanes &quot;Productor del Ao&quot;, Benito Malav &quot;Relevista del Ao&quot;, y Eddy Daz &quot;Novato del Ao&quot;.<br><br>1992-93:<br><br>El grandeliga Alvaro Espinoza pasa al Magallanes junto con Ral &quot;Tucupita&quot; Marcano y Alfredo Torres (este ltimo dejado libre posteriormente), en cambio que llev a Lester Straker, Argenis Conde y Romn Rodrguez a los Tigres de Aragua. Aunque tuvo una mala arrancada (6 ganados y 14 perdidos), el 1 de diciembre Magallanes se ubica en el segundo puesto detrs de los Leones, gracias entre otras cosas a una cadena de 11 triunfos hilvanada del 10 al 25 de noviembre (la ms larga de la divisa en una campaa). El 23 de ese ltimo mes del ao el equipo asegura su pase al round robin venciendo a los Tiburones, y al culminar la campaa Carlos Garca experimenta una gran temporada: .354 de promedio, 3 jonrones, 23 empujadas, y 14 dobles, en medio de una actuacin colectiva desbordante. El club pasa a la final por primera vez en 14 temporadas, pero no cuenta con sus dos lanzadores estrellas, Juan Francisco Castillo y Ramn Garca, ni tampoco con el toletero Eric Anthony, siendo barrido en cuatro juegos por las Aguilas del Zulia.<br><br>1993-94:<br><br>Despus de quince aos de la obtencin de su ltimo ttulo (torneo 78-79), el 31 de enero de 1994 Magallanes volvi a ser campen del Bisbol venezolano tras derrotar a su eterno rival, Leones del Caracas, en una final esperada desde haca mucho tiempo y cuyas emociones se prolongaron al mximo de siete desafos. Los Navegantes, adems de llevarse el trapo campeonil, tuvieron en sus filas a varios de los peloteros ms destacados de la contienda. El lanzador zurdo Juan Carlos Pulido logr cosechar once triunfos en la ronda eliminatoria para erigirse en el &quot;Pitcher del Ao&quot;. El importado John Hudek coleccion 19 salvados en 20 oportunidades de rescate. Luis Raven, adquirido en una negociacin realizada con el Caracas antes de iniciar la campaa, se convirti en el &quot;Novato del Ao&quot;. Fue co-lder en jonrones (7) y segundo en average (.345), adems de figurar segundo detrs de Luis Sojo en la escogencia del &quot;Jugador Ms Valioso&quot;. El 5 de noviembre se produjo el debut de Alvaro Espinoza con la camiseta del club, y el 26 de noviembre el equipo realiz una importante transaccin que llev a William Magallanes a Caribes a cambio de Oscar Azcar, quin a la postre sera figura de primer orden en la conquista del campeonato.<br><br>1994-95:<br><br>Por primera vez desde al temporada 81-82, Magallanes cont con ms de un Manager en su direccin. Despus de haber comenzado con un ritmo muy ganador bajo el mando de Tim Tolman (17-10 hasta el momento en que el estratega tuvo que regresar a su pas), el conjunto se vino a menos en la segunda parte de la campaa con Dave Hudgens como piloto (15-18), perdiendo en la ltima jornada de la eliminatoria el primer lugar de la Divisin Oriental que haba ocupado durante toda la justa. Posteriormente en el round robin, y por cuarta ocasin en su historia, Los Navegantes fueron derrotados en una tanda de desempate entre tres equipos (contra Caracas y Zulia) de la cual salieron las dos novenas que iran a la final, tras perder el juego decisivo ante Leones. En el plano individual, Eddy Daz fue el lder estafador de la liga al acumular 23 robos.<br><br>1995-96:<br><br>A pesar de terminar con record negativo de 29 ganados y 31 perdidos durante la ronda eliminatoria (el segundo lugar de la Divisin Orienta a 3 juegos del Caracas), los Navegantes se crecieron a partir del round robin para terminar alzndose merecidamente con el ttulo del histrico torneo en el cual se celebr el 50 aniversario de la Liga Venezolana de Bisbol Profesional. Enfrentando en la final al Cardenales de Lara (equipo con el mejor record de la fase regular, 36 victorias y 24 derrotas), Magallanes se convirti apenas en el tercer club en la historia del circuito en obtener el gallardete despus de estar abajo 3 a 1 en la Serie decisiva, para lo cual tuvo que ir hasta Barquisimeto y en condicin de visitante vencer de manera sorpresiva en los dos ltimos cotejos. Con un conjunto que se bas casi en su totalidad en su material nativo, y que durante gran parte del round robin y la final present alineaciones conformadas exclusivamente por peloteros del patio, los Navegantes vinieron de atrs para lograr su segundo ttulo en tres temporadas. Dicho plantel, encabezado por el ms valioso de la final, Jos Francisco Malav (.370 de average con 3 jonrones y 10 impulsadas), el recuperado Juan Francisco Castillo (2 ganados y 0.60 de efectividad en un par de aperturas) y Gregorio Machado como manager de ltima hora ante la partida de Tim Tolman, le proporcion a la divisa su octavo ttulo en el rentado, corona sazonada con la garra mostrada por su base criolla. En el intern, Magallanes propin el primer juego sin hits ni carreras para el club, y el primero que se lanza en la Liga de manera combinada, cuando el 10 de enero Donne Wall, Oscar Henrquez y Dave Evans unieron esfuerzos para realizar tal hazaa frente a los mismos Cardenales.<br><br>1996-97:<br><br>Los Navegantes del Magallanes conquistaron su segunda corona consecutiva y la tercera en cuatro aos ratificando la hegemona establecida por la divisa en la dcada de los noventa. Tras terminar con el mejor registro de la ronda eliminatoria (33 y 17) y el todos contra todos (12 y 4), la nave accedi a su cuarta final en las ltimas cinco campaas, teniendo nuevamente como adverso a los Leones del Caracas. En esa instancia la escuadra dirigida por el Estadounidense John Tamargo fue totalmente superior, para en apenas cinco juegos salir una vez ms victoriosa en una fase decisiva frente a su eterno rival. Contando con el aporte de su brillante plantel nativo, en el cual sobresalieron Edgardo Alfonzo, Richard Hidalgo (ms valioso de la final) Ramn Garca, Luis Raven, Oscar Henriquez, Juan Carlos Pulido, Edgar Ramos, Juan Francisco Castillo y Alvaro Espinoza, Magallanes obtuvo el noveno ttulo de su historia y represent a Venezuela en la Serie del Caribe de Hermosillo, Mxico, donde qued en segundo lugar con balance de 3 y 3. En medio de la temporada regular, el 3 de noviembre el zurdo Chris Roberts entr en libro de los records al lanzar frente a los Tiburones de la Guaira el segundo juego sin hit ni carreras propinado por el Magallanes. El mismo Roberts estuvo cerca de completar una hazaa sin precedentes en nuestro Bisbol cuando el 8 de diciembre lanzo ocho innings y un tercio sin permitirle inatrapable a los tigres de Aragua, hasta que Jess &quot;Chalao&quot; Mndez acab con la posibilidad de otro no hit no run en la apertura del noveno. Por otra parte, esta versin del Magallanes implant un record para la franquicia en una temporada al propinar nueve blanqueos que fueron repartidos de la siguiente manera: tiburones (3), Caribes (2), Leones (1), Aguilas (1), Pastora (1) y Tigres (1).<br><br>1997-98:<br><br>Por segundo ao seguido Magallanes finaliz en el primer lugar de la Divisin Oriental con balance de 37 ganados y 27 perdidos, teniendo como principal baluarte el ataque desplegado por Luis Raven, quien fue el mximo remolcador de la campaa con 45 y co-lider en vuela cercas con 8, adems de hilvanar una cadena de 24 juegos conectando inatrapables, lo que constituye un record para la divisa. En el pitcheo destac el Zurdo norteamericano Rich Pratt, que fue el mayor ganador del club con 6 triunfos y termin con efectividad de 1.96, en el tercer mejor regstro del circuito en ese departamento. En el Round Robin el conjunto se vino a menos, tras comenzar con tres derrotas consecutivas no se pudo recuperar para terminar el tercer lugar con marca de ocho y ocho. En medio de etapa semifinal el manager Jhon Tamargo reunci a su cargo el dia 13 de enero, siendo sustituido por Alfredo Pedrique.<br>', '2013-04-23 15:28:33');
INSERT INTO `comments` VALUES ('251', '4', '1763', '184', '184', 'Los Navegantes del Magallanes fueron establecidos por primera vez en 1917 como el equipo Magallanes de Catia, entre sus fundadores aparecen resaltados Juan y Luis Carrat, la familia Fagre y los turcos Alberto y Ricardo Salomn, Vicente Issa y Eduardo Kalil. Luego, la Liga Nacional de Bisbol se establece en el ao de 1927, por ese motivo el equipo fue puesto en pie ya que se decidi organizar anualmente campeonatos de liga. Magallanes estaba listo para ingresar a su categora.<br><br>    El deporte se fue incrementando en el pas para dar origen a muchos equipos, entre los ms resaltantes aparecen Cervecera Caracas, Pastora, Gavilanes y el Royal Criollos. La mejor poca del bisbol en Venezuela estuvo comprendido entre los aos 44 y 50, cuando la pasin estall por parte del pblico dando a conocer como los equipos ms populares a Gavilanes, Magallanes y Cervecera Caracas.<br><br>    En este periodo el equipo Magallanes particip en ocho certmenes de primera divisin  logr capturar dos ttulos y dos subcampeonatos. Don Carlos Lavaud en 1941 compra al equipo y le da una nueva perspectiva, se comenzaban a realizar los navegantes de hoy en da, as, al crearse la Liga Profesional de Bisbol, Magallanes fue uno de cuatro equipos en participar en el primer torneo de 1946.<br><br><br>    El equipo dej de llamarse Magallanes para convertirse en la temporada del 1956 en Oriente y respectivamente luego en Orientales. Fue un nuevo paso para el equipo, un respiro momentneo para volver en el torneo 1964-1965.<br><br><br>    Mucho nos da de que hablar el equipo turco &quot;cariosamente llamado&quot;. Magallanes se vino a ms para conquistar seis gallardetes, los ms sobresalientes en los aos noventa contra su rival Caracas, estos se han enfrentado en dos nicas finales y Magallanes ha salido ganador. La ltima victoria fue en la temporada 96-97. Tiene 9 campeonatos y dos Series del Caribe en las ediciones de 1970 y 1979.<br><br> <br><br>1946:<br><br>En la primera Temporada de Bisbol Profesional Venezolano, Magallanes gana el primer juego celebrado en la Liga, venciendo al Venezuela el 12 de enero con score de 5 a 2. El equipo se apunta la primera carrera anotada en la pelota rentada por Luis Aparicio Ortega, el primer boleto recibido en el beisbol profesional, por Vidal Lpez, y el primer lanzador en obtener un triunfo, Alejandro Carrasquel. Ms adelante, Quincy Troupe dispara el primer cuadrangular del club y Vidal Lpez el primero como bateador emergente. Al final de la campaa algunos magallaneros atrapan lideratos individuales, como &quot;Chucho Ramos&quot;, lder en hits con 49 y en anotadas con 30. Mientras, Pablo Garca se coron monarca entre los bateadores con promedio de .403 puntos luego de 31 imparables en 77 visitas al plato.<br><br>1946-47:<br><br>Magallanes trae el primer importado con experiencia de Liga Mayor en la persona del lanzador Sam Nahem. El 12 de Abril Nahem lanza completo por dcima tercera oportunidad de manera consecutiva, estableciendo un record para nuestra liga que todava permanece vigente. Vidal Lpez termina como lder entre los jonroneros al sacar 6 pelotas del parque, y Nahem lidera los renglones de ms triunfos con 12, y ms bateadores abanicados con 114.<br><br>1947-48:<br><br>El club queda tercero a nueve juegos del ganador, pero Vidal Lpez, el primer dolo de Bisbol venezolano, logra capturar el ttulo de los bateadores con promedio de .374. Tambin empuja 32, da 11 dobles y 4 vuelacercas para ser seleccionado por el Crculo de Periodistas Deportivos como Pelotero del Ao.<br><br>1948-49:<br><br>Luego de liderar la tabla de posiciones durante la mayor parte del campeonato, Magallanes perdi sus dos ltimos desafos frente a Cervecera Caracas, equipo que le arrebat el ttulo dejndolo en segundo lugar. Jim Pendelton con 8 jonrones 25 impulsadas resulta el ms destacado del elenco turco.<br><br>1949-50:<br><br>Magallanes captura su primer gallardete, capitaneado por Lzaro Salazar &quot;El Prncipe de Beln&quot;, siendo el club que propin ms blanqueos en la campaa con 6. Theolic Smith comparte el liderato de juegos ganados con 8, Jim Pendelton es campen bate con .387 y mayor anotador con 47, mientras que Vidal Lpez es el mximo jonronero y remolcador con 9 y 43. El 17 de noviembre Luis &quot;Camalen &quot; Garca inicia una histrica seguidilla de juegos en nuestra Liga y es designado &quot;Novato del Ao&quot; al finalizar la contienda.<br><br>1950-51:<br><br>Magallanes repite el ttulo, apuntalando por los bates de Camalen Garca, Vidal Lpez, Jim Pendelton, Joe Monteiro y Johnny Davis y por el brazo de Clem Labine, quin gan 13 estableciendo una marca de ms triunfos contra un equipo en una misma temporada, al vencer al Cervecera Caracas.<br><br>1951-52:<br><br>El 14 de Febrero de 1952 en juego contra Cervecera Caracas, Camalen establece un record de turnos en un encuentro, al pararse en el Home en 9 oportunidades. Por su parte Johnny Hetki permaneci sobre el montculo durante los 18 episodios del mismo partido para fijar un record an vigente en el profesional. Al final los turcos quedan con 28 y 28 en segundo lugar.<br><br>1952-53:<br><br>Durante el primer partido de esa campaa entre Magallanes y los debutantes Leones del Caracas, el Pitcher turco Johnny Mackinson mantuvo sin hits a los felinos durante 10 innings y 2 tercios, hasta que Alfonso Carrasquel solt el primer indiscutible. Eso ocurri el 19 de Octubre, y despus de 13 entradas el match se decidi cuando Magallanes fabric 9 anotaciones para imponerse 10 a 1. Luis &quot;Camalen&quot; Garca alcanza los lideratos de jonrones (8) y empujadas (47). El 8 de enero Quincy Troupe estableci una marca al recibir 6 boletos en un solo partido. Esto fue ante el Caracas.<br><br>1953-54:<br><br>El 14 de octubre, Bill Taylor y George Wilson sacan cada uno dos para la calle, mientras Foster Castleman y Bill Gardner conectan uno por lado para ganar 8 a 2 al que se convertira en monarca de ese ao, el Pastora, en el llamado campeonato rotatorio, estableciendo un record para la Liga de seis cuadragunlares en un juego por un mismo equipo. Al final Magallanes llega segundo, pero Bill Taylor captura el ttulo de jonrones con 16 (incluyendo un juego con tres vuelacercas frente al Caracas el 24-01-54) y de remolcador con 63 implantando nuevos registros en ambos departamentos, mientras impuso las marcas an vigentes de ms bases alcanzadas en una Temporada con 162 y de ms turnos en una campaa con 308, cantidad que tambin consumi Castleman. Por su parte Camalen Garca logra su mejor palmars en nuestro Bisbol al alcanzar sus topes en juegos (78), turnos (307), carreras (54), hits (93), dobles (17), jonrones (11) y empujadas (50). Ramn Monzant resulta lder en ganados con 14 y en ponches con 132, a la vez que George Spencer implanta un record de juegos lanzados con 44. El club consume 2 mil 687 turnos oficiales en la temporada, un record para la Liga.  <br><br>1954-55:<br><br>Por tercer ao consecutivo un magallanero lidera la Liga en cuadrangulares y en remolcadas. Esta Vez Bob Lennon fue el mejor jonronero al sacar 9 mientras remolcaba 37. Por su parte Camalen Garca anota 32 para encabezar ese rengln, y Ramn Monzant es el mximo ganador y ponchador del circuito por segundo ao, con 11 triunfos y 96 abanicados, y segundo en efectividad con 2.00, superado slo por el Carrao Bracho (1.80). Magallanes obtiene su tercer gallardete protagonizando una increble recuperacin y se acredita el segundo ttulo de un equipo venezolano ante un campen cubano en Series del Caribe. Esto fue el 14 de Febrero de 1955 contra Alacranes de Almendares.<br><br>1955-56:<br><br>Esta fue la primera campaa del Magallanes sin Vidal Lpez, ya que un ao antes haba anunciado su retiro. El 8 de diciembre Magallanes recibe el primer no hit no run de nuestro Bisbol profesional. El victimario fue el lanzador Len Yochim de los Leones del Caracas. Ese ao los marinos naufragan en el mes de enero, a pesar de que Norman Larker obtuvo el ttulo de bateo (.340), Gale Wade los de hits (75), carreras anotadas (44) y bases robadas (11), y Ramn Monzant logr por tercer ao seguido los ttulos de ms ganador y mximo ponchador (10 y 119). Al terminar la temporada, ocurri una grave crisis econmica que sac al Magallanes de los torneos locales durante ocho campaas.<br><br>1964-65:<br><br>Antonio Jos Istriz se convierte en el nuevo dueo del club, Magallanes reaparece en el Bisbol para beneplcito de su amplia legin de fanticos. El 27 de noviembre de 1964 Luis &quot;Camalen&quot; Garca conecta tres imparables, los nmeros 900, 901 y 902 de su carrera. El 22 de enero Alfonso Carrasquel juega su ltimo partido como campocorto en Venezuela, con el uniforme del Magallanes. Al final el conjunto queda eliminado, aunque Camalen atrapa el liderato de bateadores al promediar .394 puntos.<br><br>1965-66:<br><br>El 15 de octubre, fecha inaugural del torneo, el novato Graciliano Parra mantuvo sin hits ni carreras por espacio de 9 innings y 2 tercios a Tiburones de la Guaira (campen de la 64-65 y a la postre tambin monarca de esta temporada), y apenas en el dcimo episodio el cubano Jos Martnez le conecta sencillo al centro. Al final Magallanes gana 1 a 0. El conjunto clasifica amparado en el bate de Tommy Agee, quin lider al club en casi todos los renglones ofensivos, pero al llegar el play-off cae ante Tiburones en el mximo de cinco juegos, pese a ganar los dos primeros desafos y ponerse a punto del pase a la final.<br><br>1966-67:<br><br>El 25 de octubre a la altura del quinto episodio, &quot;Camalen&quot; toma un turno frente al pitcher de Cardenales Ken Sanders y dispara un incogible, para convertirse en el primero que golpea mil hits en la pelota venezolana, justo cuando participaba en su dcima octava temporada profesional. De esta forma, el pelotero de Carpano daba otro paso hacia la inmortalidad. A pesar de quedar eliminados en un mini play-off de desempate por el tercer y cuarto lugar contra la Guaira y Valencia, destaca la labor desplegada por Gracialino Parra, quin deja balance de 7 y 3 con efectividad de 2.11; y el record establecido por Bill Connors al aparecer como relevista en 40 cotejos, en lo que tuvo 4 y 4 con 10 rescates y efectividad de 2.01.<br><br>1967-68:<br><br>El 30 de diciembre, frente a Cardenales de Lara, Isaas &quot;Ltigo&quot; Chvez obtiene su quinta victoria de la campaa, la ltima que lograra con la camiseta marina. El 13 de enero fue su ltima aparicin con el Magallanes antes de su muerte. El club concluye ltimo con balance de 21 y 39.<br><br>1968-69:<br><br>Son adquiridos Dmaso Blanco y Gustavo Gil, mientras que Pat Kelly y Clarence Gaston inician la tradicn del &quot;Poder Negro&quot;. El 24 de octubre el melenudo Howie Reed le propina no hit no run al Magallanes. Gaston establece un nuevo record de empujadas con 64, y tambin comanda la Liga en dobletes con 14 y bateo con .383, para convertirse en el &quot;Jugador Ms Valioso&quot;. Esta fue la ltima campaa de Camalen Garca con el Magallanes. El 16 de marzo de 1969, Isaa &quot;Ltigo&quot; Chvez, de 21 aos, fallece cuando el avin que lo llevaba al campo de entrenamiento de los Gigantes en Arizona se desploma justo al salir de Aeropuerto &quot;Grano de Oro&quot; en Maracaibo, acabando tambin con la vida de Carlos Santelz, pelotero del Cardenales de Lara, y del propietario de ese equipo, Don Antonio Herrera.<br><br>1969-70:<br><br>Magallanes es vendido a un grupo de personas de Carabobo y se muda para Valencia. Bajo la conduccin de Patato Pascual conquista su primer ttulo desde la campaa 1954-55, derrotando en esta ocasin a los Tiburones de la Guaira en solo tres juegos. A pesar de partir antes de finalizar la temporada, Gaston repite el ttulo de bateo con .360. Ese ao se vuelve a jugar la Serie del Caribe, y el escenario es el Estadio Universitario. Magallanes se apoya en el pitcheo y obtiene el primer ttulo del Caribe para un equipo venezolano, venciendo a los representantes de Repblica Dominicana y Puerto Rico.<br><br>1970-71:<br><br>El 27 de octubre se empata un record de la Liga (tro de jonrones en un inning) cuando Gustavo Gil conecta cuadrangular por el jardn izquierdo, Jim Holt por el centro y Harold King por el derecho durante el sexto inning de un partido jugado contra los Leones, lo que adems se convierte en toda una curiosidad por la reparticin del poder. El 14 de diciembre Herman Hill, outfielder importado, muere ahogado en la playa Guaicamacuto de Puerto Cabello, Magallanes logra una difcil clasificacin, apoyado en el bate de Jim Holt, quin remolca 38 anotaciones. Pese a no ser considerado como favorito al inicio, el elenco asiste a su segunda final seguida contra Tiburones para caer en siete reidos partidos.<br><br>El da 11 de Junio de 1971 fue creada la Fundacin Magallanes de Carabobo, organismo que a partir de esa fecha se encargara de dirigir todo lo relacionado con el equipo Navegantes del Magallanes.<br><br>1971-72:<br><br>An con un buen equipo, Magallanes queda fuera al perder por segunda vez en una tanda de desempate por el tercer y cuarto puesto, jugada contra La Guaira y Caracas. Ese ao Ivn Murrell, Jim Holt, Harold King y Clarence Gaston mantienen viva la tradicin del &quot;Poder Negro&quot;.<br><br>1972-73:<br><br>La escuadra marina firma un grupo de peloteros con la intencin de crear una base nativa. Alexis Ramrez, Flix Rodrguez, el lanzador carabobeo Jos Jimnez, Esteban Padrn, y un joven de 16 aos llamado Manuel Sarmiento son los novatos. El 15 de noviembre Bob Darwin conecta 3 cuadrangulares en juego contra el Aragua, y al finalizar la contienda establece un record al sacar 19 pelotas del parque, con jonrones realmente descomunales, muchos o ms de 400 pies de distancia del Home. Sin embargo su labor no fue suficiente para clasificar al club, toda vez que queda fuera por segundo ao seguido (tercero en total) en un mini play off de desempate por los lugares tres y cuatro contra Aragua y la Guaira.<br><br>1973-74:<br><br>El primer da del mes de enero de 1974, Mark Weems, para el momento lder de juegos salvados con 11, muere ahogado en las playas de Patanemo, en Puerto Cabello. Magallanes recopil marcas de 30 y 30 en un torneo que no fue concluido debido a una huelga de peloteros.<br><br>1974-75:<br><br>Ese ao estuvieron en las filas turcas Dave Parker, Don Baylor, Jim Holt, Kent Tekulve, Larry Demery y Wayne Garland, entre otras estrellas. El 22 de noviembre Parker suelta su segundo grand slam del ao. Parker se alza con los ttulos de jonrones y empujadas, al sacar 8 y fletar 50 rayitas. El 11 de enero comienza la primera confrotacin de post-temporada entre Magallanes y Caracas, de la cual sale favorecida la novena valenciana despus de siete reidos juegos, aunque en la final los bucaneros caen frente a los Tigres de Aragua cuatro juegos a dos.<br><br>1975-76:<br><br>Luego de finalizar en cuarto lugar, el equipo es derrotado en la semifinal por Cardenales de Lara, (4-2). Manuel Sarmiento alcanza el liderato de juegos salvados en la campaa (7).<br><br>1976-77:<br><br>Tras puntear la mayor parte del campeonato (el conjunto estuvo 82 das en la punta, hasta el 12 de enero cuando cae frente a las Aguilas del Zulia) Magallanes conquista el quinto ttulo de su historia doblegando a los Tiburones y queda segundo en la Serie del Caribe. Dave Parker finaliza como campen bate con .414 de promedio, la cifra ms alta de cualquier pelotero en la historia de nuestro Bisbol Profesional. Mitchell Page lidera las empujadas con 57, los jonrones con 14 y las bases alcanzadas con 140, y Flix Rodrguez suelta 10 triples, lo que se convierte en una nueva marca en la Liga.<br><br>1977-78:<br><br>Joe Cannon conquista el ttulo de bateo con .381, golpea 91 hits para encabezar ese departamento, e iguala la marca de triples con 10 (empatando el record establecido en la anterior campaa por el magallanero Flix Rodrguez), mientras que Oswaldo Olivares lidera a los robadores de bases con 25, en una temporada en la que Magallanes queda ltimo.<br><br>1978-79:<br><br>Magallanes conquista el ttulo gracias a una espectacular recuperacin encabezada por Willie Horton, quin en su doble rol de manager-jugador hizo pasar al club del ltimo al primer lugar de la tabla de clasificacin, para vencer a las guilas en la final. Olivares resulta lder en hits con 84 y Dave Coleman en dobles con 20. En la Serie del Caribe realizada en San Juan de Puerto rico, Magallanes logra su segundo ttulo regional, con Mitchell Page en plan de hroe al sonar jonrn decisivo en el noveno inning del ltimo juego.<br><br>1979-80:<br><br>Con indeseable marca de 48 derrotas en una temporada de 70 encuentros, Magallanes ocupa el ltimo lugar a 24 juegos y medio del puntero. Para colmo, el conjunto pierde los catorce juegos de la serie contra los Leones del Caracas y el Mnager Willie horton pasa de hroe a villano siendo cesanteado sucedindole en el cargo Luis Aparicio.<br><br>1980-81:<br><br>En la peor temporada de su historia, Magallanes queda con 16 ganados y 44 derrotas, una marca que ni siquiera los equipos de expansin han registrado. Alfredo Torres se embasa en 11 ocasiones consecutivamente y conecta de hit en ocho turnos seguidos, empatando la marca de la Liga.<br><br>1981-82:<br><br>Oswaldo Olivares es canjeado a los Tigres de Aragua por Carlos Porte y Victor Davalillo, y ste ltimo es dejado libre antes de iniciarse la campaa. Al final Magallanes queda en el stano por tercera ocasin seguida, y cuarta en las ltimas cinco campaas.<br><br>1982-83:<br><br>El equipo sale del stano pero no clasifica, pues queda en el quinto puesto con 31 y 34. El zurdo Randy Niemann cumple destacada labor desde el montculo, mientras que Alfredo Torres es lder en empujadas con 45 y bases alcanzadas con 111.<br><br>1983-84:<br><br>En medio de temporada el lanzador Manuel Sarmiento es cambiado por wolfgang Ramos y Roberto Espinoza al conjunto Tigres de Aragua. Billy Hatcher establece un record al embasarse en 40 juegos consecutivos en una temporada. Al final, apuntalados por los lanzadores Chris Green, lder en efectividad con 1.46, Mike Bielecki con 69 abanicados y Mike Anderson con 8 y 3, 4 completos y lder en comienzos con 15; y los jardineros Benny Distefano y Joe Orsulak, Magallanes logra el pase al play off al vencer a los Tigres de Aragua en juego extra por el cuarto lugar. Luego la tropa turca es barrida por las guilas del Zulia en la semifinal.<br><br>1984-85:<br><br>El 26 de octubre, en su primera apertura en nuestra pelota, Omar Bencomo mantuvo sin hits a La Guaira durante 8.1 innings, hasta que Norman Carrasco conect un inatrapable. De todas maneras Bencomo no solo termin lanzando un partido de un indiscutible, sino que a la postre obtuvo la designacin del &quot;Novato del Ao&quot; con balance de 7 y 3. Alfredo Torres lidera la Liga en carreras empujadas con 48. El 12 de enero Magallanes logra el cuarto lugar y clasifica al play-off, pero cae en cinco juegos frente a los Tigres de Aragua.<br><br>1985-86:<br><br>El 16 de noviembre Mark Funderburk conecta dos cuadrangulares en un mismo inning frente a los Leones, estableciendo un record. Barry Bonds, para el momento lder del equipo en jonrones, empujadas, anotadas y robos, es dejado en libertad a principios de diciembre. Sin embargo la novena cont con buen ataque y Joe Orsulak se erigi como campen bate (.331) y mximo hiteador (80); Funderburk fue el mximo empujador (41) y Benny Distefano hizo lo propio en triples (5). Al concluir la ronda eliminatoria Magallanes queda en el primer puesto (37 ganados y 28 perdidos, alcanzando de paso la mayor cantidad de triunfos para el club en una campaa), pero no pudo pasar a la final pues sucumbe ante Tiburones de La Guaira en cinco juegos.<br><br>1986-87:<br><br>Los novatos Carlos Garca, Jos Villa, Gilberto Roca, William Magallanes, Luis Vasquez y Clemente Alvarez son firmados como parte de un proceso de renovacin. Al principio de campaa el club experimenta una seguidilla adversa de 4 blanqueos consecutivos y 41 entradas sin fabricar anotaciones. El 6 de diciembre Magallanes establece un record de carreras al derrotar 23 a 0 a las Aguilas del Zulia, la mayor diferencia con la cual ha ganado un equipo en la Liga. Magallanes culmina eliminado y en el stano.<br><br>1987-88:<br><br>Magallanes experimenta una arrancada caliente y gana todos su partidos del mes de octubre, siete en total. El 28 de noviembre Billy Bean llega a once veces seguidas embasndose, para empatar la marca de la Liga. Jos Villa encabeza el circuito con 9 triunfos, para convertirse en el primer lanzador que lidera este departamento actuando solamente como relevista.  El equipo termina segundo, pero cae en el Round Robin.<br><br>1988-89:<br><br>Alfredo Torres es dejado libre al comienzo de la campaa, ese ao el equipo queda eliminado y en el stano, la ltima vez que esto ha ocurrido en nuestros campeonatos, entre otras cosas debido al anmico promedio de bateo colectivo de .229, el ms bajo del conjunto desde su regreso a la Liga en la 64-65.<br><br>1989-90:<br><br>Tras terminar liderando la clasificacin en la ronda eliminatoria, el conjunto se desinfla en el round robin, etapa en la cual inicia perdiendo nueve juegos seguidos, para concluir con negativa marca de uno y once. William Magallanes fue lder en jonrones con 8 y empujadas con 41. Edgar Naveda conecta ocho hits en ocho turnos consecutivos, con lo que empata el record de la Liga.<br><br>1990-91:<br><br>En planes de reestruccin, 14 peloteros son dejados libres por el conjunto. El 10 de noviembre, haciendo su debut en el profesional, Juan Francisco Castillo, gana su primer juego con trabajo de cinco captulos, rivalizando con Enrique Alfonso Gmez de Zulia. El da 13 de noviembre William Magallanes golpea con vuela cercas, uno con las bases llenas, el segundo grand slam para l en esa temporada. El 3 de enero Oswaldo Olivares conecta su primer cuadrangular en Venezuela despus suena su hit nmero 900 en la Liga. Durante el round robin Magallanes queda en el camino, pero Juan Francisco Castillo es designado &quot;Novato del Ao&quot;.<br><br>1991-92:<br><br>Antes del inicio de la campaa, Juan Carlos Pulido es obtenido de Tigres de Aragua a cambio de Alfredo Pedrique, quin haba llegado el ao anterior proveniente de los Tiburones por Luis Vsquez. El 2 de enero, en juego contra el Caracas que se extendi a 18 innings, Oswaldo Olivares larg un triple en el dcimo sptimo captulo, el incogible 950 en su carrera y el ltimo con el Magallanes en temporada regular, y Eric Anthony empata la marca de ms turnos en un juego en poder de &quot;Camalen Garca&quot; desde 1952-53 al acumular 9 veces al bate. El club culmina de primero en la recin creada divisin oriental, y aunque vuelve a quedar fuera de la final al caer en el round robin, algunos turcos reciben galardones: William Magallanes &quot;Productor del Ao&quot;, Benito Malav &quot;Relevista del Ao&quot;, y Eddy Daz &quot;Novato del Ao&quot;.<br><br>1992-93:<br><br>El grandeliga Alvaro Espinoza pasa al Magallanes junto con Ral &quot;Tucupita&quot; Marcano y Alfredo Torres (este ltimo dejado libre posteriormente), en cambio que llev a Lester Straker, Argenis Conde y Romn Rodrguez a los Tigres de Aragua. Aunque tuvo una mala arrancada (6 ganados y 14 perdidos), el 1 de diciembre Magallanes se ubica en el segundo puesto detrs de los Leones, gracias entre otras cosas a una cadena de 11 triunfos hilvanada del 10 al 25 de noviembre (la ms larga de la divisa en una campaa). El 23 de ese ltimo mes del ao el equipo asegura su pase al round robin venciendo a los Tiburones, y al culminar la campaa Carlos Garca experimenta una gran temporada: .354 de promedio, 3 jonrones, 23 empujadas, y 14 dobles, en medio de una actuacin colectiva desbordante. El club pasa a la final por primera vez en 14 temporadas, pero no cuenta con sus dos lanzadores estrellas, Juan Francisco Castillo y Ramn Garca, ni tampoco con el toletero Eric Anthony, siendo barrido en cuatro juegos por las Aguilas del Zulia.<br><br>1993-94:<br><br>Despus de quince aos de la obtencin de su ltimo ttulo (torneo 78-79), el 31 de enero de 1994 Magallanes volvi a ser campen del Bisbol venezolano tras derrotar a su eterno rival, Leones del Caracas, en una final esperada desde haca mucho tiempo y cuyas emociones se prolongaron al mximo de siete desafos. Los Navegantes, adems de llevarse el trapo campeonil, tuvieron en sus filas a varios de los peloteros ms destacados de la contienda. El lanzador zurdo Juan Carlos Pulido logr cosechar once triunfos en la ronda eliminatoria para erigirse en el &quot;Pitcher del Ao&quot;. El importado John Hudek coleccion 19 salvados en 20 oportunidades de rescate. Luis Raven, adquirido en una negociacin realizada con el Caracas antes de iniciar la campaa, se convirti en el &quot;Novato del Ao&quot;. Fue co-lder en jonrones (7) y segundo en average (.345), adems de figurar segundo detrs de Luis Sojo en la escogencia del &quot;Jugador Ms Valioso&quot;. El 5 de noviembre se produjo el debut de Alvaro Espinoza con la camiseta del club, y el 26 de noviembre el equipo realiz una importante transaccin que llev a William Magallanes a Caribes a cambio de Oscar Azcar, quin a la postre sera figura de primer orden en la conquista del campeonato.<br><br>1994-95:<br><br>Por primera vez desde al temporada 81-82, Magallanes cont con ms de un Manager en su direccin. Despus de haber comenzado con un ritmo muy ganador bajo el mando de Tim Tolman (17-10 hasta el momento en que el estratega tuvo que regresar a su pas), el conjunto se vino a menos en la segunda parte de la campaa con Dave Hudgens como piloto (15-18), perdiendo en la ltima jornada de la eliminatoria el primer lugar de la Divisin Oriental que haba ocupado durante toda la justa. Posteriormente en el round robin, y por cuarta ocasin en su historia, Los Navegantes fueron derrotados en una tanda de desempate entre tres equipos (contra Caracas y Zulia) de la cual salieron las dos novenas que iran a la final, tras perder el juego decisivo ante Leones. En el plano individual, Eddy Daz fue el lder estafador de la liga al acumular 23 robos.<br><br>1995-96:<br><br>A pesar de terminar con record negativo de 29 ganados y 31 perdidos durante la ronda eliminatoria (el segundo lugar de la Divisin Orienta a 3 juegos del Caracas), los Navegantes se crecieron a partir del round robin para terminar alzndose merecidamente con el ttulo del histrico torneo en el cual se celebr el 50 aniversario de la Liga Venezolana de Bisbol Profesional. Enfrentando en la final al Cardenales de Lara (equipo con el mejor record de la fase regular, 36 victorias y 24 derrotas), Magallanes se convirti apenas en el tercer club en la historia del circuito en obtener el gallardete despus de estar abajo 3 a 1 en la Serie decisiva, para lo cual tuvo que ir hasta Barquisimeto y en condicin de visitante vencer de manera sorpresiva en los dos ltimos cotejos. Con un conjunto que se bas casi en su totalidad en su material nativo, y que durante gran parte del round robin y la final present alineaciones conformadas exclusivamente por peloteros del patio, los Navegantes vinieron de atrs para lograr su segundo ttulo en tres temporadas. Dicho plantel, encabezado por el ms valioso de la final, Jos Francisco Malav (.370 de average con 3 jonrones y 10 impulsadas), el recuperado Juan Francisco Castillo (2 ganados y 0.60 de efectividad en un par de aperturas) y Gregorio Machado como manager de ltima hora ante la partida de Tim Tolman, le proporcion a la divisa su octavo ttulo en el rentado, corona sazonada con la garra mostrada por su base criolla. En el intern, Magallanes propin el primer juego sin hits ni carreras para el club, y el primero que se lanza en la Liga de manera combinada, cuando el 10 de enero Donne Wall, Oscar Henrquez y Dave Evans unieron esfuerzos para realizar tal hazaa frente a los mismos Cardenales.<br><br>1996-97:<br><br>Los Navegantes del Magallanes conquistaron su segunda corona consecutiva y la tercera en cuatro aos ratificando la hegemona establecida por la divisa en la dcada de los noventa. Tras terminar con el mejor registro de la ronda eliminatoria (33 y 17) y el todos contra todos (12 y 4), la nave accedi a su cuarta final en las ltimas cinco campaas, teniendo nuevamente como adverso a los Leones del Caracas. En esa instancia la escuadra dirigida por el Estadounidense John Tamargo fue totalmente superior, para en apenas cinco juegos salir una vez ms victoriosa en una fase decisiva frente a su eterno rival. Contando con el aporte de su brillante plantel nativo, en el cual sobresalieron Edgardo Alfonzo, Richard Hidalgo (ms valioso de la final) Ramn Garca, Luis Raven, Oscar Henriquez, Juan Carlos Pulido, Edgar Ramos, Juan Francisco Castillo y Alvaro Espinoza, Magallanes obtuvo el noveno ttulo de su historia y represent a Venezuela en la Serie del Caribe de Hermosillo, Mxico, donde qued en segundo lugar con balance de 3 y 3. En medio de la temporada regular, el 3 de noviembre el zurdo Chris Roberts entr en libro de los records al lanzar frente a los Tiburones de la Guaira el segundo juego sin hit ni carreras propinado por el Magallanes. El mismo Roberts estuvo cerca de completar una hazaa sin precedentes en nuestro Bisbol cuando el 8 de diciembre lanzo ocho innings y un tercio sin permitirle inatrapable a los tigres de Aragua, hasta que Jess &quot;Chalao&quot; Mndez acab con la posibilidad de otro no hit no run en la apertura del noveno. Por otra parte, esta versin del Magallanes implant un record para la franquicia en una temporada al propinar nueve blanqueos que fueron repartidos de la siguiente manera: tiburones (3), Caribes (2), Leones (1), Aguilas (1), Pastora (1) y Tigres (1).<br><br>1997-98:<br><br>Por segundo ao seguido Magallanes finaliz en el primer lugar de la Divisin Oriental con balance de 37 ganados y 27 perdidos, teniendo como principal baluarte el ataque desplegado por Luis Raven, quien fue el mximo remolcador de la campaa con 45 y co-lider en vuela cercas con 8, adems de hilvanar una cadena de 24 juegos conectando inatrapables, lo que constituye un record para la divisa. En el pitcheo destac el Zurdo norteamericano Rich Pratt, que fue el mayor ganador del club con 6 triunfos y termin con efectividad de 1.96, en el tercer mejor regstro del circuito en ese departamento. En el Round Robin el conjunto se vino a menos, tras comenzar con tres derrotas consecutivas no se pudo recuperar para terminar el tercer lugar con marca de ocho y ocho. En medio de etapa semifinal el manager Jhon Tamargo reunci a su cargo el dia 13 de enero, siendo sustituido por Alfredo Pedrique.<br>', '2013-04-23 15:28:38');
INSERT INTO `comments` VALUES ('252', '4', '1763', '184', '184', 'Los Navegantes del Magallanes fueron establecidos por primera vez en 1917 como el equipo Magallanes de Catia, entre sus fundadores aparecen resaltados Juan y Luis Carrat, la familia Fagre y los turcos Alberto y Ricardo Salomn, Vicente Issa y Eduardo Kalil. Luego, la Liga Nacional de Bisbol se establece en el ao de 1927, por ese motivo el equipo fue puesto en pie ya que se decidi organizar anualmente campeonatos de liga. Magallanes estaba listo para ingresar a su categora.<br><br>    El deporte se fue incrementando en el pas para dar origen a muchos equipos, entre los ms resaltantes aparecen Cervecera Caracas, Pastora, Gavilanes y el Royal Criollos. La mejor poca del bisbol en Venezuela estuvo comprendido entre los aos 44 y 50, cuando la pasin estall por parte del pblico dando a conocer como los equipos ms populares a Gavilanes, Magallanes y Cervecera Caracas.<br><br>    En este periodo el equipo Magallanes particip en ocho certmenes de primera divisin  logr capturar dos ttulos y dos subcampeonatos. Don Carlos Lavaud en 1941 compra al equipo y le da una nueva perspectiva, se comenzaban a realizar los navegantes de hoy en da, as, al crearse la Liga Profesional de Bisbol, Magallanes fue uno de cuatro equipos en participar en el primer torneo de 1946.<br><br><br>    El equipo dej de llamarse Magallanes para convertirse en la temporada del 1956 en Oriente y respectivamente luego en Orientales. Fue un nuevo paso para el equipo, un respiro momentneo para volver en el torneo 1964-1965.<br><br><br>    Mucho nos da de que hablar el equipo turco &quot;cariosamente llamado&quot;. Magallanes se vino a ms para conquistar seis gallardetes, los ms sobresalientes en los aos noventa contra su rival Caracas, estos se han enfrentado en dos nicas finales y Magallanes ha salido ganador. La ltima victoria fue en la temporada 96-97. Tiene 9 campeonatos y dos Series del Caribe en las ediciones de 1970 y 1979.<br><br> <br><br>1946:<br><br>En la primera Temporada de Bisbol Profesional Venezolano, Magallanes gana el primer juego celebrado en la Liga, venciendo al Venezuela el 12 de enero con score de 5 a 2. El equipo se apunta la primera carrera anotada en la pelota rentada por Luis Aparicio Ortega, el primer boleto recibido en el beisbol profesional, por Vidal Lpez, y el primer lanzador en obtener un triunfo, Alejandro Carrasquel. Ms adelante, Quincy Troupe dispara el primer cuadrangular del club y Vidal Lpez el primero como bateador emergente. Al final de la campaa algunos magallaneros atrapan lideratos individuales, como &quot;Chucho Ramos&quot;, lder en hits con 49 y en anotadas con 30. Mientras, Pablo Garca se coron monarca entre los bateadores con promedio de .403 puntos luego de 31 imparables en 77 visitas al plato.<br><br>1946-47:<br><br>Magallanes trae el primer importado con experiencia de Liga Mayor en la persona del lanzador Sam Nahem. El 12 de Abril Nahem lanza completo por dcima tercera oportunidad de manera consecutiva, estableciendo un record para nuestra liga que todava permanece vigente. Vidal Lpez termina como lder entre los jonroneros al sacar 6 pelotas del parque, y Nahem lidera los renglones de ms triunfos con 12, y ms bateadores abanicados con 114.<br><br>1947-48:<br><br>El club queda tercero a nueve juegos del ganador, pero Vidal Lpez, el primer dolo de Bisbol venezolano, logra capturar el ttulo de los bateadores con promedio de .374. Tambin empuja 32, da 11 dobles y 4 vuelacercas para ser seleccionado por el Crculo de Periodistas Deportivos como Pelotero del Ao.<br><br>1948-49:<br><br>Luego de liderar la tabla de posiciones durante la mayor parte del campeonato, Magallanes perdi sus dos ltimos desafos frente a Cervecera Caracas, equipo que le arrebat el ttulo dejndolo en segundo lugar. Jim Pendelton con 8 jonrones 25 impulsadas resulta el ms destacado del elenco turco.<br><br>1949-50:<br><br>Magallanes captura su primer gallardete, capitaneado por Lzaro Salazar &quot;El Prncipe de Beln&quot;, siendo el club que propin ms blanqueos en la campaa con 6. Theolic Smith comparte el liderato de juegos ganados con 8, Jim Pendelton es campen bate con .387 y mayor anotador con 47, mientras que Vidal Lpez es el mximo jonronero y remolcador con 9 y 43. El 17 de noviembre Luis &quot;Camalen &quot; Garca inicia una histrica seguidilla de juegos en nuestra Liga y es designado &quot;Novato del Ao&quot; al finalizar la contienda.<br><br>1950-51:<br><br>Magallanes repite el ttulo, apuntalando por los bates de Camalen Garca, Vidal Lpez, Jim Pendelton, Joe Monteiro y Johnny Davis y por el brazo de Clem Labine, quin gan 13 estableciendo una marca de ms triunfos contra un equipo en una misma temporada, al vencer al Cervecera Caracas.<br><br>1951-52:<br><br>El 14 de Febrero de 1952 en juego contra Cervecera Caracas, Camalen establece un record de turnos en un encuentro, al pararse en el Home en 9 oportunidades. Por su parte Johnny Hetki permaneci sobre el montculo durante los 18 episodios del mismo partido para fijar un record an vigente en el profesional. Al final los turcos quedan con 28 y 28 en segundo lugar.<br><br>1952-53:<br><br>Durante el primer partido de esa campaa entre Magallanes y los debutantes Leones del Caracas, el Pitcher turco Johnny Mackinson mantuvo sin hits a los felinos durante 10 innings y 2 tercios, hasta que Alfonso Carrasquel solt el primer indiscutible. Eso ocurri el 19 de Octubre, y despus de 13 entradas el match se decidi cuando Magallanes fabric 9 anotaciones para imponerse 10 a 1. Luis &quot;Camalen&quot; Garca alcanza los lideratos de jonrones (8) y empujadas (47). El 8 de enero Quincy Troupe estableci una marca al recibir 6 boletos en un solo partido. Esto fue ante el Caracas.<br><br>1953-54:<br><br>El 14 de octubre, Bill Taylor y George Wilson sacan cada uno dos para la calle, mientras Foster Castleman y Bill Gardner conectan uno por lado para ganar 8 a 2 al que se convertira en monarca de ese ao, el Pastora, en el llamado campeonato rotatorio, estableciendo un record para la Liga de seis cuadragunlares en un juego por un mismo equipo. Al final Magallanes llega segundo, pero Bill Taylor captura el ttulo de jonrones con 16 (incluyendo un juego con tres vuelacercas frente al Caracas el 24-01-54) y de remolcador con 63 implantando nuevos registros en ambos departamentos, mientras impuso las marcas an vigentes de ms bases alcanzadas en una Temporada con 162 y de ms turnos en una campaa con 308, cantidad que tambin consumi Castleman. Por su parte Camalen Garca logra su mejor palmars en nuestro Bisbol al alcanzar sus topes en juegos (78), turnos (307), carreras (54), hits (93), dobles (17), jonrones (11) y empujadas (50). Ramn Monzant resulta lder en ganados con 14 y en ponches con 132, a la vez que George Spencer implanta un record de juegos lanzados con 44. El club consume 2 mil 687 turnos oficiales en la temporada, un record para la Liga.  <br><br>1954-55:<br><br>Por tercer ao consecutivo un magallanero lidera la Liga en cuadrangulares y en remolcadas. Esta Vez Bob Lennon fue el mejor jonronero al sacar 9 mientras remolcaba 37. Por su parte Camalen Garca anota 32 para encabezar ese rengln, y Ramn Monzant es el mximo ganador y ponchador del circuito por segundo ao, con 11 triunfos y 96 abanicados, y segundo en efectividad con 2.00, superado slo por el Carrao Bracho (1.80). Magallanes obtiene su tercer gallardete protagonizando una increble recuperacin y se acredita el segundo ttulo de un equipo venezolano ante un campen cubano en Series del Caribe. Esto fue el 14 de Febrero de 1955 contra Alacranes de Almendares.<br><br>1955-56:<br><br>Esta fue la primera campaa del Magallanes sin Vidal Lpez, ya que un ao antes haba anunciado su retiro. El 8 de diciembre Magallanes recibe el primer no hit no run de nuestro Bisbol profesional. El victimario fue el lanzador Len Yochim de los Leones del Caracas. Ese ao los marinos naufragan en el mes de enero, a pesar de que Norman Larker obtuvo el ttulo de bateo (.340), Gale Wade los de hits (75), carreras anotadas (44) y bases robadas (11), y Ramn Monzant logr por tercer ao seguido los ttulos de ms ganador y mximo ponchador (10 y 119). Al terminar la temporada, ocurri una grave crisis econmica que sac al Magallanes de los torneos locales durante ocho campaas.<br><br>1964-65:<br><br>Antonio Jos Istriz se convierte en el nuevo dueo del club, Magallanes reaparece en el Bisbol para beneplcito de su amplia legin de fanticos. El 27 de noviembre de 1964 Luis &quot;Camalen&quot; Garca conecta tres imparables, los nmeros 900, 901 y 902 de su carrera. El 22 de enero Alfonso Carrasquel juega su ltimo partido como campocorto en Venezuela, con el uniforme del Magallanes. Al final el conjunto queda eliminado, aunque Camalen atrapa el liderato de bateadores al promediar .394 puntos.<br><br>1965-66:<br><br>El 15 de octubre, fecha inaugural del torneo, el novato Graciliano Parra mantuvo sin hits ni carreras por espacio de 9 innings y 2 tercios a Tiburones de la Guaira (campen de la 64-65 y a la postre tambin monarca de esta temporada), y apenas en el dcimo episodio el cubano Jos Martnez le conecta sencillo al centro. Al final Magallanes gana 1 a 0. El conjunto clasifica amparado en el bate de Tommy Agee, quin lider al club en casi todos los renglones ofensivos, pero al llegar el play-off cae ante Tiburones en el mximo de cinco juegos, pese a ganar los dos primeros desafos y ponerse a punto del pase a la final.<br><br>1966-67:<br><br>El 25 de octubre a la altura del quinto episodio, &quot;Camalen&quot; toma un turno frente al pitcher de Cardenales Ken Sanders y dispara un incogible, para convertirse en el primero que golpea mil hits en la pelota venezolana, justo cuando participaba en su dcima octava temporada profesional. De esta forma, el pelotero de Carpano daba otro paso hacia la inmortalidad. A pesar de quedar eliminados en un mini play-off de desempate por el tercer y cuarto lugar contra la Guaira y Valencia, destaca la labor desplegada por Gracialino Parra, quin deja balance de 7 y 3 con efectividad de 2.11; y el record establecido por Bill Connors al aparecer como relevista en 40 cotejos, en lo que tuvo 4 y 4 con 10 rescates y efectividad de 2.01.<br><br>1967-68:<br><br>El 30 de diciembre, frente a Cardenales de Lara, Isaas &quot;Ltigo&quot; Chvez obtiene su quinta victoria de la campaa, la ltima que lograra con la camiseta marina. El 13 de enero fue su ltima aparicin con el Magallanes antes de su muerte. El club concluye ltimo con balance de 21 y 39.<br><br>1968-69:<br><br>Son adquiridos Dmaso Blanco y Gustavo Gil, mientras que Pat Kelly y Clarence Gaston inician la tradicn del &quot;Poder Negro&quot;. El 24 de octubre el melenudo Howie Reed le propina no hit no run al Magallanes. Gaston establece un nuevo record de empujadas con 64, y tambin comanda la Liga en dobletes con 14 y bateo con .383, para convertirse en el &quot;Jugador Ms Valioso&quot;. Esta fue la ltima campaa de Camalen Garca con el Magallanes. El 16 de marzo de 1969, Isaa &quot;Ltigo&quot; Chvez, de 21 aos, fallece cuando el avin que lo llevaba al campo de entrenamiento de los Gigantes en Arizona se desploma justo al salir de Aeropuerto &quot;Grano de Oro&quot; en Maracaibo, acabando tambin con la vida de Carlos Santelz, pelotero del Cardenales de Lara, y del propietario de ese equipo, Don Antonio Herrera.<br><br>1969-70:<br><br>Magallanes es vendido a un grupo de personas de Carabobo y se muda para Valencia. Bajo la conduccin de Patato Pascual conquista su primer ttulo desde la campaa 1954-55, derrotando en esta ocasin a los Tiburones de la Guaira en solo tres juegos. A pesar de partir antes de finalizar la temporada, Gaston repite el ttulo de bateo con .360. Ese ao se vuelve a jugar la Serie del Caribe, y el escenario es el Estadio Universitario. Magallanes se apoya en el pitcheo y obtiene el primer ttulo del Caribe para un equipo venezolano, venciendo a los representantes de Repblica Dominicana y Puerto Rico.<br><br>1970-71:<br><br>El 27 de octubre se empata un record de la Liga (tro de jonrones en un inning) cuando Gustavo Gil conecta cuadrangular por el jardn izquierdo, Jim Holt por el centro y Harold King por el derecho durante el sexto inning de un partido jugado contra los Leones, lo que adems se convierte en toda una curiosidad por la reparticin del poder. El 14 de diciembre Herman Hill, outfielder importado, muere ahogado en la playa Guaicamacuto de Puerto Cabello, Magallanes logra una difcil clasificacin, apoyado en el bate de Jim Holt, quin remolca 38 anotaciones. Pese a no ser considerado como favorito al inicio, el elenco asiste a su segunda final seguida contra Tiburones para caer en siete reidos partidos.<br><br>El da 11 de Junio de 1971 fue creada la Fundacin Magallanes de Carabobo, organismo que a partir de esa fecha se encargara de dirigir todo lo relacionado con el equipo Navegantes del Magallanes.<br><br>1971-72:<br><br>An con un buen equipo, Magallanes queda fuera al perder por segunda vez en una tanda de desempate por el tercer y cuarto puesto, jugada contra La Guaira y Caracas. Ese ao Ivn Murrell, Jim Holt, Harold King y Clarence Gaston mantienen viva la tradicin del &quot;Poder Negro&quot;.<br><br>1972-73:<br><br>La escuadra marina firma un grupo de peloteros con la intencin de crear una base nativa. Alexis Ramrez, Flix Rodrguez, el lanzador carabobeo Jos Jimnez, Esteban Padrn, y un joven de 16 aos llamado Manuel Sarmiento son los novatos. El 15 de noviembre Bob Darwin conecta 3 cuadrangulares en juego contra el Aragua, y al finalizar la contienda establece un record al sacar 19 pelotas del parque, con jonrones realmente descomunales, muchos o ms de 400 pies de distancia del Home. Sin embargo su labor no fue suficiente para clasificar al club, toda vez que queda fuera por segundo ao seguido (tercero en total) en un mini play off de desempate por los lugares tres y cuatro contra Aragua y la Guaira.<br><br>1973-74:<br><br>El primer da del mes de enero de 1974, Mark Weems, para el momento lder de juegos salvados con 11, muere ahogado en las playas de Patanemo, en Puerto Cabello. Magallanes recopil marcas de 30 y 30 en un torneo que no fue concluido debido a una huelga de peloteros.<br><br>1974-75:<br><br>Ese ao estuvieron en las filas turcas Dave Parker, Don Baylor, Jim Holt, Kent Tekulve, Larry Demery y Wayne Garland, entre otras estrellas. El 22 de noviembre Parker suelta su segundo grand slam del ao. Parker se alza con los ttulos de jonrones y empujadas, al sacar 8 y fletar 50 rayitas. El 11 de enero comienza la primera confrotacin de post-temporada entre Magallanes y Caracas, de la cual sale favorecida la novena valenciana despus de siete reidos juegos, aunque en la final los bucaneros caen frente a los Tigres de Aragua cuatro juegos a dos.<br><br>1975-76:<br><br>Luego de finalizar en cuarto lugar, el equipo es derrotado en la semifinal por Cardenales de Lara, (4-2). Manuel Sarmiento alcanza el liderato de juegos salvados en la campaa (7).<br><br>1976-77:<br><br>Tras puntear la mayor parte del campeonato (el conjunto estuvo 82 das en la punta, hasta el 12 de enero cuando cae frente a las Aguilas del Zulia) Magallanes conquista el quinto ttulo de su historia doblegando a los Tiburones y queda segundo en la Serie del Caribe. Dave Parker finaliza como campen bate con .414 de promedio, la cifra ms alta de cualquier pelotero en la historia de nuestro Bisbol Profesional. Mitchell Page lidera las empujadas con 57, los jonrones con 14 y las bases alcanzadas con 140, y Flix Rodrguez suelta 10 triples, lo que se convierte en una nueva marca en la Liga.<br><br>1977-78:<br><br>Joe Cannon conquista el ttulo de bateo con .381, golpea 91 hits para encabezar ese departamento, e iguala la marca de triples con 10 (empatando el record establecido en la anterior campaa por el magallanero Flix Rodrguez), mientras que Oswaldo Olivares lidera a los robadores de bases con 25, en una temporada en la que Magallanes queda ltimo.<br><br>1978-79:<br><br>Magallanes conquista el ttulo gracias a una espectacular recuperacin encabezada por Willie Horton, quin en su doble rol de manager-jugador hizo pasar al club del ltimo al primer lugar de la tabla de clasificacin, para vencer a las guilas en la final. Olivares resulta lder en hits con 84 y Dave Coleman en dobles con 20. En la Serie del Caribe realizada en San Juan de Puerto rico, Magallanes logra su segundo ttulo regional, con Mitchell Page en plan de hroe al sonar jonrn decisivo en el noveno inning del ltimo juego.<br><br>1979-80:<br><br>Con indeseable marca de 48 derrotas en una temporada de 70 encuentros, Magallanes ocupa el ltimo lugar a 24 juegos y medio del puntero. Para colmo, el conjunto pierde los catorce juegos de la serie contra los Leones del Caracas y el Mnager Willie horton pasa de hroe a villano siendo cesanteado sucedindole en el cargo Luis Aparicio.<br><br>1980-81:<br><br>En la peor temporada de su historia, Magallanes queda con 16 ganados y 44 derrotas, una marca que ni siquiera los equipos de expansin han registrado. Alfredo Torres se embasa en 11 ocasiones consecutivamente y conecta de hit en ocho turnos seguidos, empatando la marca de la Liga.<br><br>1981-82:<br><br>Oswaldo Olivares es canjeado a los Tigres de Aragua por Carlos Porte y Victor Davalillo, y ste ltimo es dejado libre antes de iniciarse la campaa. Al final Magallanes queda en el stano por tercera ocasin seguida, y cuarta en las ltimas cinco campaas.<br><br>1982-83:<br><br>El equipo sale del stano pero no clasifica, pues queda en el quinto puesto con 31 y 34. El zurdo Randy Niemann cumple destacada labor desde el montculo, mientras que Alfredo Torres es lder en empujadas con 45 y bases alcanzadas con 111.<br><br>1983-84:<br><br>En medio de temporada el lanzador Manuel Sarmiento es cambiado por wolfgang Ramos y Roberto Espinoza al conjunto Tigres de Aragua. Billy Hatcher establece un record al embasarse en 40 juegos consecutivos en una temporada. Al final, apuntalados por los lanzadores Chris Green, lder en efectividad con 1.46, Mike Bielecki con 69 abanicados y Mike Anderson con 8 y 3, 4 completos y lder en comienzos con 15; y los jardineros Benny Distefano y Joe Orsulak, Magallanes logra el pase al play off al vencer a los Tigres de Aragua en juego extra por el cuarto lugar. Luego la tropa turca es barrida por las guilas del Zulia en la semifinal.<br><br>1984-85:<br><br>El 26 de octubre, en su primera apertura en nuestra pelota, Omar Bencomo mantuvo sin hits a La Guaira durante 8.1 innings, hasta que Norman Carrasco conect un inatrapable. De todas maneras Bencomo no solo termin lanzando un partido de un indiscutible, sino que a la postre obtuvo la designacin del &quot;Novato del Ao&quot; con balance de 7 y 3. Alfredo Torres lidera la Liga en carreras empujadas con 48. El 12 de enero Magallanes logra el cuarto lugar y clasifica al play-off, pero cae en cinco juegos frente a los Tigres de Aragua.<br><br>1985-86:<br><br>El 16 de noviembre Mark Funderburk conecta dos cuadrangulares en un mismo inning frente a los Leones, estableciendo un record. Barry Bonds, para el momento lder del equipo en jonrones, empujadas, anotadas y robos, es dejado en libertad a principios de diciembre. Sin embargo la novena cont con buen ataque y Joe Orsulak se erigi como campen bate (.331) y mximo hiteador (80); Funderburk fue el mximo empujador (41) y Benny Distefano hizo lo propio en triples (5). Al concluir la ronda eliminatoria Magallanes queda en el primer puesto (37 ganados y 28 perdidos, alcanzando de paso la mayor cantidad de triunfos para el club en una campaa), pero no pudo pasar a la final pues sucumbe ante Tiburones de La Guaira en cinco juegos.<br><br>1986-87:<br><br>Los novatos Carlos Garca, Jos Villa, Gilberto Roca, William Magallanes, Luis Vasquez y Clemente Alvarez son firmados como parte de un proceso de renovacin. Al principio de campaa el club experimenta una seguidilla adversa de 4 blanqueos consecutivos y 41 entradas sin fabricar anotaciones. El 6 de diciembre Magallanes establece un record de carreras al derrotar 23 a 0 a las Aguilas del Zulia, la mayor diferencia con la cual ha ganado un equipo en la Liga. Magallanes culmina eliminado y en el stano.<br><br>1987-88:<br><br>Magallanes experimenta una arrancada caliente y gana todos su partidos del mes de octubre, siete en total. El 28 de noviembre Billy Bean llega a once veces seguidas embasndose, para empatar la marca de la Liga. Jos Villa encabeza el circuito con 9 triunfos, para convertirse en el primer lanzador que lidera este departamento actuando solamente como relevista.  El equipo termina segundo, pero cae en el Round Robin.<br><br>1988-89:<br><br>Alfredo Torres es dejado libre al comienzo de la campaa, ese ao el equipo queda eliminado y en el stano, la ltima vez que esto ha ocurrido en nuestros campeonatos, entre otras cosas debido al anmico promedio de bateo colectivo de .229, el ms bajo del conjunto desde su regreso a la Liga en la 64-65.<br><br>1989-90:<br><br>Tras terminar liderando la clasificacin en la ronda eliminatoria, el conjunto se desinfla en el round robin, etapa en la cual inicia perdiendo nueve juegos seguidos, para concluir con negativa marca de uno y once. William Magallanes fue lder en jonrones con 8 y empujadas con 41. Edgar Naveda conecta ocho hits en ocho turnos consecutivos, con lo que empata el record de la Liga.<br><br>1990-91:<br><br>En planes de reestruccin, 14 peloteros son dejados libres por el conjunto. El 10 de noviembre, haciendo su debut en el profesional, Juan Francisco Castillo, gana su primer juego con trabajo de cinco captulos, rivalizando con Enrique Alfonso Gmez de Zulia. El da 13 de noviembre William Magallanes golpea con vuela cercas, uno con las bases llenas, el segundo grand slam para l en esa temporada. El 3 de enero Oswaldo Olivares conecta su primer cuadrangular en Venezuela despus suena su hit nmero 900 en la Liga. Durante el round robin Magallanes queda en el camino, pero Juan Francisco Castillo es designado &quot;Novato del Ao&quot;.<br><br>1991-92:<br><br>Antes del inicio de la campaa, Juan Carlos Pulido es obtenido de Tigres de Aragua a cambio de Alfredo Pedrique, quin haba llegado el ao anterior proveniente de los Tiburones por Luis Vsquez. El 2 de enero, en juego contra el Caracas que se extendi a 18 innings, Oswaldo Olivares larg un triple en el dcimo sptimo captulo, el incogible 950 en su carrera y el ltimo con el Magallanes en temporada regular, y Eric Anthony empata la marca de ms turnos en un juego en poder de &quot;Camalen Garca&quot; desde 1952-53 al acumular 9 veces al bate. El club culmina de primero en la recin creada divisin oriental, y aunque vuelve a quedar fuera de la final al caer en el round robin, algunos turcos reciben galardones: William Magallanes &quot;Productor del Ao&quot;, Benito Malav &quot;Relevista del Ao&quot;, y Eddy Daz &quot;Novato del Ao&quot;.<br><br>1992-93:<br><br>El grandeliga Alvaro Espinoza pasa al Magallanes junto con Ral &quot;Tucupita&quot; Marcano y Alfredo Torres (este ltimo dejado libre posteriormente), en cambio que llev a Lester Straker, Argenis Conde y Romn Rodrguez a los Tigres de Aragua. Aunque tuvo una mala arrancada (6 ganados y 14 perdidos), el 1 de diciembre Magallanes se ubica en el segundo puesto detrs de los Leones, gracias entre otras cosas a una cadena de 11 triunfos hilvanada del 10 al 25 de noviembre (la ms larga de la divisa en una campaa). El 23 de ese ltimo mes del ao el equipo asegura su pase al round robin venciendo a los Tiburones, y al culminar la campaa Carlos Garca experimenta una gran temporada: .354 de promedio, 3 jonrones, 23 empujadas, y 14 dobles, en medio de una actuacin colectiva desbordante. El club pasa a la final por primera vez en 14 temporadas, pero no cuenta con sus dos lanzadores estrellas, Juan Francisco Castillo y Ramn Garca, ni tampoco con el toletero Eric Anthony, siendo barrido en cuatro juegos por las Aguilas del Zulia.<br><br>1993-94:<br><br>Despus de quince aos de la obtencin de su ltimo ttulo (torneo 78-79), el 31 de enero de 1994 Magallanes volvi a ser campen del Bisbol venezolano tras derrotar a su eterno rival, Leones del Caracas, en una final esperada desde haca mucho tiempo y cuyas emociones se prolongaron al mximo de siete desafos. Los Navegantes, adems de llevarse el trapo campeonil, tuvieron en sus filas a varios de los peloteros ms destacados de la contienda. El lanzador zurdo Juan Carlos Pulido logr cosechar once triunfos en la ronda eliminatoria para erigirse en el &quot;Pitcher del Ao&quot;. El importado John Hudek coleccion 19 salvados en 20 oportunidades de rescate. Luis Raven, adquirido en una negociacin realizada con el Caracas antes de iniciar la campaa, se convirti en el &quot;Novato del Ao&quot;. Fue co-lder en jonrones (7) y segundo en average (.345), adems de figurar segundo detrs de Luis Sojo en la escogencia del &quot;Jugador Ms Valioso&quot;. El 5 de noviembre se produjo el debut de Alvaro Espinoza con la camiseta del club, y el 26 de noviembre el equipo realiz una importante transaccin que llev a William Magallanes a Caribes a cambio de Oscar Azcar, quin a la postre sera figura de primer orden en la conquista del campeonato.<br><br>1994-95:<br><br>Por primera vez desde al temporada 81-82, Magallanes cont con ms de un Manager en su direccin. Despus de haber comenzado con un ritmo muy ganador bajo el mando de Tim Tolman (17-10 hasta el momento en que el estratega tuvo que regresar a su pas), el conjunto se vino a menos en la segunda parte de la campaa con Dave Hudgens como piloto (15-18), perdiendo en la ltima jornada de la eliminatoria el primer lugar de la Divisin Oriental que haba ocupado durante toda la justa. Posteriormente en el round robin, y por cuarta ocasin en su historia, Los Navegantes fueron derrotados en una tanda de desempate entre tres equipos (contra Caracas y Zulia) de la cual salieron las dos novenas que iran a la final, tras perder el juego decisivo ante Leones. En el plano individual, Eddy Daz fue el lder estafador de la liga al acumular 23 robos.<br><br>1995-96:<br><br>A pesar de terminar con record negativo de 29 ganados y 31 perdidos durante la ronda eliminatoria (el segundo lugar de la Divisin Orienta a 3 juegos del Caracas), los Navegantes se crecieron a partir del round robin para terminar alzndose merecidamente con el ttulo del histrico torneo en el cual se celebr el 50 aniversario de la Liga Venezolana de Bisbol Profesional. Enfrentando en la final al Cardenales de Lara (equipo con el mejor record de la fase regular, 36 victorias y 24 derrotas), Magallanes se convirti apenas en el tercer club en la historia del circuito en obtener el gallardete despus de estar abajo 3 a 1 en la Serie decisiva, para lo cual tuvo que ir hasta Barquisimeto y en condicin de visitante vencer de manera sorpresiva en los dos ltimos cotejos. Con un conjunto que se bas casi en su totalidad en su material nativo, y que durante gran parte del round robin y la final present alineaciones conformadas exclusivamente por peloteros del patio, los Navegantes vinieron de atrs para lograr su segundo ttulo en tres temporadas. Dicho plantel, encabezado por el ms valioso de la final, Jos Francisco Malav (.370 de average con 3 jonrones y 10 impulsadas), el recuperado Juan Francisco Castillo (2 ganados y 0.60 de efectividad en un par de aperturas) y Gregorio Machado como manager de ltima hora ante la partida de Tim Tolman, le proporcion a la divisa su octavo ttulo en el rentado, corona sazonada con la garra mostrada por su base criolla. En el intern, Magallanes propin el primer juego sin hits ni carreras para el club, y el primero que se lanza en la Liga de manera combinada, cuando el 10 de enero Donne Wall, Oscar Henrquez y Dave Evans unieron esfuerzos para realizar tal hazaa frente a los mismos Cardenales.<br><br>1996-97:<br><br>Los Navegantes del Magallanes conquistaron su segunda corona consecutiva y la tercera en cuatro aos ratificando la hegemona establecida por la divisa en la dcada de los noventa. Tras terminar con el mejor registro de la ronda eliminatoria (33 y 17) y el todos contra todos (12 y 4), la nave accedi a su cuarta final en las ltimas cinco campaas, teniendo nuevamente como adverso a los Leones del Caracas. En esa instancia la escuadra dirigida por el Estadounidense John Tamargo fue totalmente superior, para en apenas cinco juegos salir una vez ms victoriosa en una fase decisiva frente a su eterno rival. Contando con el aporte de su brillante plantel nativo, en el cual sobresalieron Edgardo Alfonzo, Richard Hidalgo (ms valioso de la final) Ramn Garca, Luis Raven, Oscar Henriquez, Juan Carlos Pulido, Edgar Ramos, Juan Francisco Castillo y Alvaro Espinoza, Magallanes obtuvo el noveno ttulo de su historia y represent a Venezuela en la Serie del Caribe de Hermosillo, Mxico, donde qued en segundo lugar con balance de 3 y 3. En medio de la temporada regular, el 3 de noviembre el zurdo Chris Roberts entr en libro de los records al lanzar frente a los Tiburones de la Guaira el segundo juego sin hit ni carreras propinado por el Magallanes. El mismo Roberts estuvo cerca de completar una hazaa sin precedentes en nuestro Bisbol cuando el 8 de diciembre lanzo ocho innings y un tercio sin permitirle inatrapable a los tigres de Aragua, hasta que Jess &quot;Chalao&quot; Mndez acab con la posibilidad de otro no hit no run en la apertura del noveno. Por otra parte, esta versin del Magallanes implant un record para la franquicia en una temporada al propinar nueve blanqueos que fueron repartidos de la siguiente manera: tiburones (3), Caribes (2), Leones (1), Aguilas (1), Pastora (1) y Tigres (1).<br><br>1997-98:<br><br>Por segundo ao seguido Magallanes finaliz en el primer lugar de la Divisin Oriental con balance de 37 ganados y 27 perdidos, teniendo como principal baluarte el ataque desplegado por Luis Raven, quien fue el mximo remolcador de la campaa con 45 y co-lider en vuela cercas con 8, adems de hilvanar una cadena de 24 juegos conectando inatrapables, lo que constituye un record para la divisa. En el pitcheo destac el Zurdo norteamericano Rich Pratt, que fue el mayor ganador del club con 6 triunfos y termin con efectividad de 1.96, en el tercer mejor regstro del circuito en ese departamento. En el Round Robin el conjunto se vino a menos, tras comenzar con tres derrotas consecutivas no se pudo recuperar para terminar el tercer lugar con marca de ocho y ocho. En medio de etapa semifinal el manager Jhon Tamargo reunci a su cargo el dia 13 de enero, siendo sustituido por Alfredo Pedrique.<br>', '2013-04-23 15:28:41');
