INSERT INTO `comments` VALUES ('259', '4', '1778', '184', '0', 'Martina Stoessel interpreta a Violetta Castillo, una chica luminosa y llena de vida, pero solitaria y sobreprotegida por su padre. Posee una voz nica que hered de su madre, pero an no lo sabe. De su padre hered el amor por la lectura y una gran inteligencia. Violetta es espontnea y sincera a la hora de decir lo que piensa. Al regresar a Buenos Aires, comienza a tomar clases particulares de piano en el Studio 21, una prestigiosa academia de msica. All descubre un nuevo mundo que la llevar a encontrar su propio destino y su historia familiar.<br>Pablo Espinosa interpreta a Toms Heredia, es atractivo, sencillo, seguro de s mismo y a veces un poco distante. Toca la guitarra y canta. Sus canciones reflejan su personalidad y su bsqueda como artista. Asiste al Studio 21, becado por el profesor Beto, quien lo contrata como su asistente. Naci en Espaa, pero se mud a Buenos Aires con su madre para cuidar a su abuela. Toms se enamora de Violetta a pesar de que Germn intenta mantener a su hija lejos de cualquier candidato. Su principal competidor por el amor de Violetta es Len.<br>Jorge Blanco interpreta a Len, es arrogante, credo y un tanto vanidoso. A pesar de eso, Len tiene buen corazn, pero cuando est con Ludmila se potencian y puede parecer malo. A diferencia de Toms, viene de una familia adinerada y nunca tuvo que trabajar. Len toma clases en el Studio 21, y tambin tiene un gran potencial como artista. Al principio quiere conquistar a Violetta para vengarse de Toms, por quien su novia Ludmila se siente atrada. Sin embargo, y muy a su pesar, se ir enamorando de Violetta.<br>Mercedes Lambre interpreta a Ludmila Ferro, es la chica cool y glamorosa del Studio 21, lo que la convierte en la novia ideal para Len. Pero lo que tiene de diva, tambin lo tiene de mentirosa, manipuladora, y soberbia. Pese a ser totalmente diferente a Toms, se siente atrada por l. Pero Toms la ignora porque est enamorado de Violetta, lo cual desata sus celos y obsesin. Vive pendiente de su imagen y quiere ser siempre el centro de atencin, especialmente en el Studio 21. Considera a Violetta su principal enemiga, ya que su talento y belleza natural pueden opacarla.<br>Diego Ramos interpreta a Germn Castillo, es el padre de Violetta. Es un brillante ingeniero, dueo de una constructora internacional que hace obras pblicas y privadas de gran calibre. Es estricto y exigente. Desde la muerte de su esposa ha sobreprotegido a su hija, pero detrs de su rigidez esconde un gran corazn.<br>Clara Alonso interpreta a ngeles Carrar, es alegre, divertida, carismtica, amante de la msica y el arte, Angie es un espritu libre que irradia luz a su alrededor. Es la hermana de quien fue la esposa de Germn, pero Violetta no sabe que es su ta. Tras la muerte de su hermana, Angie intent contactarse con su sobrina en varias oportunidades, pero sin xito. Por eso, cuando Violetta regresa a Buenos Aires, se hace pasar por la nueva institutriz para acercarse a ella.<br>Diego Domnguez interpreta a Diego, es un chico que viene de Espaa y al llegar queda deslumbrado por el talento y belleza de Violetta. Con su arrogancia y modales de ?chico malo?, hace lo imposible por conquistarla.', '2013-04-25 08:44:30');
