al desata sus celos y obsesin. Vive pendiente de su imagen y quiere ser siempre el centro de atencin, especialmente en el Studio 21. Considera a Violetta su principal enemiga, ya que su talento y belleza natural pueden opacarla.<br>Diego Ramos interpreta a Germn Castillo, es el padre de Violetta. Es un brillante ingeniero, dueo de una constructora internacional que hace obras pblicas y privadas de gran calibre. Es estricto y exigente. Desde la muerte de su esposa ha sobreprotegido a su hija, pero detrs de su rigidez esconde un gran corazn.<br>Clara Alonso interpreta a ngeles Carrar, es alegre, divertida, carismtica, amante de la msica y el arte, Angie es un espritu libre que irradia luz a su alrededor. Es la hermana de quien fue la esposa de Germn, pero Violetta no sabe que es su ta. Tras la muerte de su hermana, Angie intent contactarse con su sobrina en varias oportunidades, pero sin xito. Por eso, cuando Violetta regresa a Buenos Aires, se hace pasar por la nueva institutriz para acercarse a ella.<br>Diego Domnguez interpreta a Diego, es un chico que viene de Espaa y al llegar queda deslumbrado por el talento y belleza de Violetta. Con su arrogancia y modales de ?chico malo?, hace lo imposible por conquistarla.', '2013-04-25 08:44:45');
