INSERT INTO `comments` VALUES ('272', '4', '1778', '184', '0', 'As las cosas, durante algn tiempo ejerci la docencia como profesor de teatro, ocupacin que fue alternando con sus primeras composiciones de letras musicales para grupos de samba y bossa nova. En estas letras de Paulo Coellho se aprecia ntidamente un influjo de distintas corrientes espirituales puestas en estrecha relacin con los postulados del movimiento hippie de los aos sesenta. Aos despus (desde 1974 hasta 1981), sus aficiones y saberes musicales le llevaron a aceptar un puesto de ejecutivo en la casa discogrfica Polygram. Anteriormente, Paulo Coelho haba ejercido tambin el periodismo, dedicacin que culmin en una etapa al frente de la direccin del peridico Express Underground.<br><br>Mientras desempeaba estas variadas actividades, Coelho no abandonaba su empeo de convertirse en un escritor consagrado. Finalmente, el empujn decisivo le lleg en 1981, cuando viaj a Holanda en compaa de su esposa para entablar contacto directo con un misterioso personaje, Jean, que a partir de entonces se convirti en su maestro y empez a ejercer sobre el escritor brasileo una influencia similar a la que deja en sus aclitos un gua espiritual.<br><br>Jean introdujo a Paulo Coelho en la hermandad RAM (Regnum Agnum Mundi), una especie de orden religiosa de confesin catlica, que hunde sus orgenes en la Espaa medieval. A partir de entonces, Coelho, que fue nombrado caballero de dicha orden, comenz a prodigar sus visitas a Espaa, que dieron por fruto su primera aportacin destacada a la narrativa universal. Se trata de El diario de un mago, obra en la que relata las peripecias de su propia peregrinacin hacia Santiago, en busca de una espada que representa el mximo poder en su mistrica hermandad.<br><br>Poco tiempo despus, Paulo Coelho volvi a los anaqueles de las libreras con una narracin breve titulada L&apos;Alchimista (El alquimista, 1988), en la que presentaba a un pastor que, siguiendo el dictado de sus sueos, parte de Andaluca para adentrarse en la soledad del desierto.<br><br>Escrita en apenas quince das, El alquimista se convirti de inmediato en uno de los mayores xitos contemporneos de la literatura escrita en lengua portuguesa. Fue traducida a numerosos idiomas (en la actualidad, hay ms de veinticinco versiones en otras tantas lenguas), y durante muchas semanas bati todos los rcords de permanencia en las listas de los libros ms vendidos de Brasil, Francia, Italia e Israel. En Espaa, la obra despert tanto inters que, a los diez aos de haber aparecido, ya haba alcanzado prcticamente las cincuenta reediciones; y en todo el mundo se han vendido, durante el decenio que va desde 1988 hasta 1998, unos diez millones de ejemplares.<br><br>La crtica literaria universal, admirada no slo por la calidad de El alquimista, sino por la sorprendente circunstancia de que Coelho se hubiera convertido de repente en el escritor hispanoamericano que ms libros venda en todo el mundo (despus de Gabriel Garca Mrquez), no escatim sus elogios a la hora de situar esta obrita a la altura de otras piezas maestras del gnero, como El Principito de Antonie de Saint-Exupry o Juan Salvador Gaviota, de Richard Bach.<br><br>En efecto, tanta fue la repercusin de El alquimista, que en 1994 fue considerado como &quot;El libro del ao&quot; por la Library Association de Estados Unidos, y en mayo de 1996 fue finalista del prestigioso Premio &quot;Ennio Flaiano&quot; de narrativa. Pocos das despus (el 2 de junio de 1996), su autor fue distinguido con el premio &quot;Crinzane Cavour&quot;, uno de los galardones internacionales ms importantes de nuestro tiempo. Adems, en el mes de abril de aquel mismo ao Paulo Coelho haba sido reconocido en Pars con las insignias de Caballero de las Artes y las Letras Francesas.', '2013-04-25 11:31:49');
